(70, 1, 43, 'Objektovo orientované programovanie', 'objektovo-orientovane-programovanie', '739', '<p>OOP dok&aacute;že mnoho ľud&iacute; spoľahlivo odradiť hneď na začiatku v&yacute;razmi ako dedičnosť, polymorfizmus, zapuzdrenie, abstrakcia a in&yacute;mi veľmi m&uacute;dro znej&uacute;cimi slovami. My v&aacute;m norm&aacute;lnou ľudskou rečou veľmi r&yacute;chlo uk&aacute;žeme, že sa za t&yacute;m neskr&yacute;va skutočne nič zložit&eacute;.</p>\n', 1, 4, '2017-02-04 10:50:17', '2017-02-04 10:50:17', '2017-02-04 10:50:17', 1, 0),
(71, 9, 43, 'Na ktorého obľúbeného Markízaka sa ponášate?', 'na-ktoreho-oblubeneho-markizaka-sa-ponasate', '740', '<p><span style=\"font-family:roboto,sans-serif,tahoma; font-size:15px\">Pripravili sme pre v&aacute;s hor&uacute;cu novinku - origin&aacute;lne interakt&iacute;vne kv&iacute;zy z na&scaron;ej dieľne.</span><strong>Telev&iacute;zia Mark&iacute;za&nbsp;</strong><span style=\"font-family:roboto,sans-serif,tahoma; font-size:15px\">je s&uacute;časťou v&aacute;&scaron;ho života už dvadsať rokov. Pozn&aacute;te jej moder&aacute;torov a redaktorov? Na ktor&eacute;ho z nich sa pon&aacute;&scaron;ate? Urobte si kv&iacute;z.&nbsp;&nbsp;</span></p>\n', 2, 5, '2017-02-05 10:49:07', '2017-02-05 10:49:07', '2017-02-05 10:49:07', 1, 0),
(82, 1, 49, 'Objektovo orientované programovanie', 'objektovo-orientovane-programovanie', '739', '<p>OOP dok&aacute;že mnoho ľud&iacute; spoľahlivo odradiť hneď na začiatku v&yacute;razmi ako dedičnosť, polymorfizmus, zapuzdrenie, abstrakcia a in&yacute;mi veľmi m&uacute;dro znej&uacute;cimi slovami. My v&aacute;m norm&aacute;lnou ľudskou rečou veľmi r&yacute;chlo uk&aacute;žeme, že sa za t&yacute;m neskr&yacute;va skutočne nič zložit&eacute;.</p>\n', 1, 4, '2017-02-04 10:50:17', '2017-02-04 10:50:17', '2017-02-04 10:50:17', 1, 0),
(83, 9, 49, 'Na ktorého obľúbeného Markízaka sa ponášate?', 'na-ktoreho-oblubeneho-markizaka-sa-ponasate', '740', '<p><span style=\"font-family:roboto,sans-serif,tahoma; font-size:15px\">Pripravili sme pre v&aacute;s hor&uacute;cu novinku - origin&aacute;lne interakt&iacute;vne kv&iacute;zy z na&scaron;ej dieľne.</span><strong>Telev&iacute;zia Mark&iacute;za&nbsp;</strong><span style=\"font-family:roboto,sans-serif,tahoma; font-size:15px\">je s&uacute;časťou v&aacute;&scaron;ho života už dvadsať rokov. Pozn&aacute;te jej moder&aacute;torov a redaktorov? Na ktor&eacute;ho z nich sa pon&aacute;&scaron;ate? Urobte si kv&iacute;z.&nbsp;&nbsp;</span></p>\n', 2, 5, '2017-02-05 10:49:07', '2017-02-05 10:49:07', '2017-02-05 10:49:07', 1, 0);
