(2732, 291, 9, 0, '>Ste príjemná osoba so srdcom na správnom mieste. Neúnavne veríte v dobro a každý dotyk s krutou realitou vás nepríjemne zaskočí. Všímate sa prírodu, životné prostredie a s ťažkosťou znášate nespravodlivosť okolo nás. Za jemnou fasádou sa však skrýva bojovník, ktorý si nenechá len tak ľahko skákať po hlave. Taká je aj moderátorka \n    <b>Janka Hospodárová\n    </b>.', 'winning_combination', 'Janka Hospodárová', '745', 0, 20, 0, 0, 43),
