(3166, 257, 9, 0, 'Ste štýlová osobnosť , ktorá má vo veciach jasno. Úspešne ste naštartovali svoju kariéru, ktorú zvládate rovnocenne kombinovať s rodinou. Hlučné večierky a masy ľudí nie sú nič pre vás, prednosť dávate rodinnému krbu, aj keď na to nevyzeráte. Na verejnosti sa totiž vždy objavíte dokonalo zladený a hýrite šarmom. Presne ako moderátorka Televíznych novín \n    <b>Zlatica Puškárová\n    </b>. ', 'winning_combination', ' Zlatica Puškárová', '741', 0, 4, 5, 0, 49),
(3167, 258, 9, 0, 'Akcia, pohyb, výzva! To je váš svet, v ktorom sa cítite ako ryba vo vode. V kancelárii by ste neobsedeli, musíte neustále niečo robiť. Šplhať sa na vrcholky hôr, brodiť sa rozbúrenou riekou či bicyklovať desiatky kilometrov. Život je pre vás výzva a vy máte výzvy rád. Hodené rukavice prijímate a keď je toho na vás veľa, hlavu si prečistíte v prírode. Napríklad jazdou na koni ako redaktor \n    <b>Ján Tribula\n    </b>.', 'winning_combination', ' Ján Tribula', '742', 0, 8, 5, 0, 49),
(3168, 259, 9, 0, 'Váš život je šport, aktivita a zdravý životný štýl. Snažíte sa však aj o súlad s duchom a preto sa neustále rozvíjate. Učíte sa cudzie jazyky, čítate a ste schopný zariadiť množstvo vecí. Pôsobíte nenápadne, nerád na seba strhávate pozornosť. V spoločnosti priateľov sa však meníte na parketového leva. Presne ako športový redaktor \n    <b>Peter Varinský\n    </b>.', 'winning_combination', ' Peter Varinský', '743', 0, 12, 5, 0, 49),
(3169, 260, 9, 1, '', 'question', 'Kráčate po ulici a zrazu vidíte sanitky, policajtov, masu ľudí a počujete krik. Čo urobíte?', '', 0, 0, 5, 0, 49),
(3170, 261, 9, 1, '', 'ans', 'Okamžite utekám priamo tam, musím vedieť čo sa stalo.', '', 0, 1, 0, 0, 49),
(3171, 262, 9, 1, '', 'ans', 'Všetko poctivo zdokumentujem a nezabudnem na selfie.', '', 0, 2, 0, 0, 49),
(3172, 263, 9, 1, '', 'ans', 'Zbystrím pozornosť, no zostávam v úzadí.', '', 0, 3, 0, 0, 49),
(3173, 264, 9, 1, '', 'ans', 'Bežím na miesto činu bez rozmyslenia, túžim priložiť ruku k dielu a upokojiť situáciu.', '', 0, 4, 0, 0, 49),
(3174, 265, 9, 1, '', 'ans', 'Opatrne sa tam priblížim, možno niekto bude potrebovať pomoc.', '', 0, 5, 0, 0, 49),
(3175, 266, 9, 2, '', 'question', 'Je leto, teplo, slnko a voda láka. Kde sa vidíte počas prázdnin?', '', 0, 0, 4, 0, 49),
(3176, 267, 9, 2, '', 'ans', 'Na skvelej dovolenke all inclusive s rodinou', '', 0, 1, 0, 0, 49),
