(290, 17, 14156, 'intro', 43, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Nakupujete golfov&eacute; vybaven&iacute; v prodejn&aacute;ch GolfProfi nebo na eshopu <a href=\"http://www.golfprofi.cz/\" target=\"_blank\">www.golfprofi.cz</a>, odeb&iacute;r&aacute;te GolfProfi newsletter nebo jste členem věrnostn&iacute;ho programu <a href=\"https://www.golfprofi.cz/cs/login?back=my-account\" target=\"_blank\">GolfProfi Premium Club</a>? </strong>Pak hrajte o skvěl&yacute; golfov&yacute; pobyt pro dva př&iacute;mo v Alp&aacute;ch v regionu Zell am See-Kaprun!</span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>Soutěž prob&iacute;ha od 10.04. do 10.06.2018.</strong></span></p>\r\n\r\n<p><span style=\"font-size:16px\">Podm&iacute;nkou &uacute;časti v soutěži, pro neregistrovan&eacute; z&aacute;kazn&iacute;ky je n&aacute;kup v prodejn&aacute;ch nebo na eshopu GolfProfi, registrovan&iacute; z&aacute;kazn&iacute;ci se můžou z&uacute;častnit soutěže bez podm&iacute;nky n&aacute;kupu! Do soutěže se můžete zaregistrovat i v&iacute;cekr&aacute;t, pokud opakovaně nakoup&iacute;te v prodejn&aacute;ch nebo na eshopu GolfProfi.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">V&yacute;hry v soutěži: <strong>2x luxusn&iacute; golfov&yacute; pobyt pro 2 osoby, na 5 dn&iacute; / 4noci&nbsp;</strong></span><span style=\"font-size:16px\"><strong>ubytov&aacute;n&iacute; v 4* hotelu&nbsp;s polopenz&iacute;, včetně greenfee,<br />\r\nv regionu Zell am See-Kaprun&nbsp;.</strong>&nbsp;Přejeme V&aacute;m hodně &scaron;těst&iacute; při slosov&aacute;n&iacute;!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
