(323, 57, 14159, 'registracia', 43, 'koniec_registracie', '<p>SOUTĚŽ BYLA UKONČENA DNE 1.11. 2016.</p>\r\n\n\r\n\n<p>Slosov&aacute;n&iacute; proběhlo dne 04.11.2016, ze v&scaron;ech přijat&yacute;ch platn&yacute;ch registrac&iacute; byli vybr&aacute;ni&nbsp; 3 v&yacute;herci dle pravidel soutěže. Dovolenkov&yacute; pobyt v Salzburgu pro 2 osoby na 4&nbsp;dny (3&nbsp;noci), ubytov&aacute;n&iacute; ve 3-4*hotelu se sn&iacute;dan&iacute;, včetně 3-denn&iacute; slevov&eacute; karty &bdquo;SalzburgCard&ldquo; z&iacute;sk&aacute;vaj&iacute; :</p>\r\n\n\r\n\n<p><strong>Tereza Seidlov&aacute;, 54701 N&aacute;chod, ČR</strong></p>\r\n\n\r\n\n<p><strong>Marie Herzogov&aacute;, 53701 Chrudim, ČR</strong></p>\r\n\n\r\n\n<p><strong>Gabriela Zpěv&aacute;kov&aacute;, 78313 &Scaron;těp&aacute;nov, ČR</strong></p>\r\n\n\r\n\n<p>V&yacute;herci budou kontaktov&aacute;ni provozovatelem soutěže ohledně převzet&iacute; pobytov&yacute;ch voucherů v nejbliž&scaron;&iacute;ch dnech. Pobytov&eacute; vouchery jsou platn&eacute; 31.10.2017, pobyty nezahrnujou dopravu.</p>\r\n\n\r\n\n<p><u><strong>V&scaron;em děkujeme za &uacute;čast a v&yacute;hercům srdečne blahopřejeme!</strong></u></p>\r\n\n\r\n\n<p><span style=\"font-size:12px\">Spr&aacute;vnost a platnost slosov&aacute;n&iacute; potvrzuj&iacute; provozovatel&eacute; soutěže:<br />\r\n\nOrganiz&aacute;tor: TSG Tourismus Salzburg GmbH Auerspergstra&szlig;e 6, 5020 Salzburg, Rakousko<br />\r\n\na spoluorganiz&aacute;tor soutěže: GOLDTIME a.s., U Libeňsk&eacute;ho pivovaru 10, Praha 8, Česk&aacute; republika</span></p>\r\n\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(324, 58, 14157, 'region', 43, 'name', 'Zell Am See', 'text', 2, 'Názov v rámci stránky', 0, 1),
(325, 59, 14157, 'region', 43, 'text_1', '<p><strong>ZELL AM SEE-KAPRUN - UŽIJ SI RADOST NAPLNO!<br />\r\nDovolen&aacute; mezi ledovcem, horami a jezerem&nbsp;</strong><br />\r\nZell am See-Kaprun v sam&eacute;m srdci rakousk&yacute;ch Alp je př&iacute;rodn&iacute; a rekreačn&iacute; r&aacute;j par excellence. Na &uacute;pat&iacute; hory Kitzsteinhorn vysok&eacute; 3203 metrů a zellsk&eacute; m&iacute;stn&iacute; obl&iacute;ben&eacute; hory Schmittenh&ouml;he se kolem kři&scaron;ť&aacute;lově čist&eacute;ho jezera Zeller See pln&iacute; př&aacute;n&iacute; a požadavky na rekreaci v&scaron;eho druhu: Turistům a milovn&iacute;kům vodn&iacute;ch sportů, rodin&aacute;m s dětmi a milovn&iacute;kům př&iacute;rody, cyklistům a běžcům, milovn&iacute;kům adrenalinov&eacute; z&aacute;bavy a požitk&aacute;řům, vyznavačům j&oacute;gy a golfov&yacute;m nad&scaron;encům.</p>\r\n\r\n<p><strong>Nejlep&scaron;&iacute; tipy na nezapomenutelnou letn&iacute; dovolenou:</strong></p>\r\n\r\n<ul>\r\n	<li>Tři m&iacute;stn&iacute; hory Schmittenh&ouml;he, Kitzsteinhorn a Maiskogel jsou považov&aacute;ny za skutečně rekreačn&iacute; oblasti a nab&iacute;z&iacute; turistům, cyklistům a rodin&aacute;m &scaron;irokou &scaron;k&aacute;lu různ&yacute;ch aktivit</li>\r\n	<li>&bdquo;Kitzsteinhorn Explorer Tour&quot;. Prohl&iacute;dka s průvodcem do čtyř klimatick&yacute;ch z&oacute;n s n&aacute;slednou n&aacute;v&scaron;těvou nejvy&scaron;&scaron;&iacute; vyhl&iacute;dkov&eacute; platformy v Salcburku &bdquo;Top of Salzburg&ldquo;</li>\r\n	<li>Vysokohorsk&eacute; přehrady v Kaprunu nab&iacute;zej&iacute; lezeckou stezku na jedn&eacute; přehradn&iacute; zdi, kter&aacute; je celosvětově v nejvy&scaron;&scaron;&iacute; nadmořsk&eacute; v&yacute;&scaron;ce, k nab&iacute;dce tak&eacute; patř&iacute; lezeck&aacute; ar&eacute;na H&ouml;henburg</li>\r\n	<li>J&oacute;dlov&aacute;n&iacute; na hoře, j&oacute;ga na stand-up-boardu nebo setk&aacute;n&iacute; s bylink&aacute;řsk&yacute;mi čarodějnicemi na Schmittenh&ouml;he</li>\r\n	<li>&bdquo;Zellsk&eacute; jezern&iacute; kouzlo&ldquo; (&bdquo;Zeller Seezauber&ldquo;)- velkolep&aacute; vodn&iacute;, světeln&aacute;, hudebn&iacute; a laserov&aacute; show a pocta světově proslul&eacute;mu jezeru v Zell am See</li>\r\n</ul>\r\n\r\n<p>S praktickou letn&iacute; kartou <a href=\"https://www.zellamsee-kaprun.com/cs/summercard\" target=\"_blank\">Zell am See-Kaprun SommerCard</a>&nbsp;lze nav&scaron;t&iacute;vit až 40 atrakc&iacute; -v&yacute;letn&iacute; c&iacute;le, pam&aacute;tky a muzea v tomto regionu a v cel&eacute; zemi Salcbursko. Kromě toho opravňuje k mnoha dal&scaron;&iacute;m slev&aacute;m. Plat&iacute; v obdob&iacute; od 15. května do 15. ř&iacute;jna a z&iacute;skat ji lze ve z&uacute;častněn&yacute;ch ubytovac&iacute;ch&nbsp;zař&iacute;zen&iacute;ch.<br />\r\nV&iacute;ce se dozv&iacute;te zde: <a href=\"https://www.zellamsee-kaprun.com/cs\" target=\"_blank\">www.zellamsee-kaprun.com</a></p>\r\n', 'content', 2, 'Text 1', 0, 1),
(326, 60, 14157, 'region', 43, 'text_2', '<p><strong>ZELL AM SEE-KAPRUN - UŽI SI RADOSŤ NAPLNO!</strong><br />\r\n<strong>Dovolenka medzi ľadovcom, horami a jazerom</strong><br />\r\nZell am See-Kaprun v srdci rak&uacute;skych &Aacute;lp je pr&iacute;rodn&yacute; a dovolenkov&yacute; raj par excellence. Na &uacute;p&auml;t&iacute; hory Kitzsteinhorn vysokej 3203 metrov a zellskej miestne obľ&uacute;benej hory Schmittenh&ouml;he sa v okol&iacute; kři&scaron;t&aacute;lovo čist&eacute;ho jazera Zeller See plnia priania a požiadavky na rekre&aacute;ciu v&scaron;etk&eacute;ho druhu: pre turistov a milovn&iacute;kov vodn&yacute;ch &scaron;portov, rodiny s deťmi a milovn&iacute;kov pr&iacute;rody , cyklistov a bežcov, milovn&iacute;kov adrenal&iacute;novej z&aacute;bavy aj milovn&iacute;kov pohody, vyznavačov j&oacute;gy a golfov&yacute;ch nad&scaron;encov.</p>\r\n\r\n<p><strong>Najlep&scaron;ie tipy na nezabudnuteľn&uacute; letn&uacute; dovolenku:</strong></p>\r\n\r\n<ul>\r\n	<li>Tri miestne hory Schmittenh&ouml;he, Kitzsteinhorn a Maiskogel s&uacute; považovan&eacute; za skutočne rekreačn&eacute; oblasti a pon&uacute;kaj&uacute; turistom, cyklistom a rodin&aacute;m &scaron;irok&uacute; &scaron;k&aacute;lu r&ocirc;znych aktiv&iacute;t</li>\r\n	<li>&bdquo;Kitzsteinhorn Explorer Tour&quot;. Prehliadka so sprievodcom cez &scaron;tyri klimatick&eacute; z&oacute;ny a n&aacute;slednou n&aacute;v&scaron;tevou najvy&scaron;&scaron;ej vyhliadkovej platformy v Salzburgsku &bdquo;Top of Salzburg&ldquo;</li>\r\n	<li>Vysokohorsk&eacute; priehrady v Kaprune pon&uacute;kaj&uacute; lezeck&uacute; trasu na priehradnom m&uacute;re, ktor&aacute; je celosvetovo v najvy&scaron;&scaron;ej nadmorskej v&yacute;&scaron;ke, ponuku dopĺňa lezeck&aacute; ar&eacute;na H&ouml;henburg</li>\r\n	<li>J&oacute;dlovanie na hore, j&oacute;ga na stand-up-boarde alebo stretnutie s bylink&aacute;rkami čarodejnicami na Schmittenh&ouml;he</li>\r\n	<li>&bdquo;Zellsk&eacute; jazern&eacute; k&uacute;zlo&ldquo; (&bdquo;Zeller Seezauber&ldquo;)- veľkolep&aacute; vodn&aacute;, sveteln&aacute;, hudobn&aacute; a laserov&aacute; show a pocta svetovo presl&aacute;ven&eacute;mu jazeru v Zell am See</li>\r\n</ul>\r\n\r\n<p>S praktickou letnou kartou <a href=\"https://www.zellamsee-kaprun.com/cs/summercard\" target=\"_blank\">Zell am See-Kaprun SommerCard</a>&nbsp;m&ocirc;žete nav&scaron;t&iacute;viť až 40 atrakci&iacute; -v&yacute;letn&eacute; ciele, pamiatky a muze&aacute; v tomto regi&oacute;ne a v celom Salzburgsku. Okrem toho opr&aacute;vňuje na množstvo ďaľ&scaron;&iacute;ch zliav. Plat&iacute; v obdob&iacute; od 15. m&aacute;ja do 15. okt&oacute;bra a z&iacute;skať ju m&ocirc;žete v partnersk&yacute;ch ubytovac&iacute;ch zariadeniach.&nbsp;<br />\r\nViac sa dozviete tu: <a href=\"https://www.zellamsee-kaprun.com/sk\" target=\"_blank\">www.zellamsee-kaprun.com</a></p>\r\n', 'content', 2, 'Text 2', 0, 1),
