(343, 105, 14158, 'hotely', 43, 'id_3_text', '<p><strong>ALPENHAUS KAPRUN&nbsp;</strong>nab&iacute;z&iacute; v r&aacute;mci dovolen&eacute; na nejvy&scaron;&scaron;&iacute; &uacute;rovni vydařen&yacute; mix radost&iacute; sest&aacute;vaj&iacute;c&iacute; z alpsk&eacute;ho životn&iacute;ho stylu, kulin&aacute;řstv&iacute;, sportu a wellness. V osobit&eacute; atmosf&eacute;ře 4-hvězdičkov&eacute;ho hotelu v centru Kaprunu v salcbursk&eacute;m Pinzgau host&eacute; zažij&iacute; nejvy&scaron;&scaron;&iacute; kulturu bydlen&iacute; , kterou poskytuje 122 moderně zař&iacute;zen&yacute;ch pokojů a apartm&aacute;nů. Do tohoto modern&iacute;ho alpsk&eacute;ho r&aacute;mce zapad&aacute; i vybran&aacute; hotelov&aacute; kuchyně, kter&aacute; poskytuje potě&scaron;uj&iacute;c&iacute; z&aacute;žitek pro smysly gurm&aacute;nů. Kulin&aacute;řskou nab&iacute;dku doplňuj&iacute; vegetari&aacute;nsk&aacute; a vegansk&aacute; j&iacute;dla. Okamžiky radosti pro tělo i du&scaron;i nab&iacute;z&iacute; l&aacute;zně ALPEN.VEDA.SPA na plo&scaron;e o 1000 m&sup2; na 2 podlaž&iacute;ch s 6 saunami, solnou parn&iacute; l&aacute;zn&iacute;, relaxačn&iacute;mi m&iacute;stnostmi s vodn&iacute;mi lůžky, whirlpoolem, kryt&yacute;m baz&eacute;nem a s &scaron;irokou &scaron;k&aacute;lou procedur.</p>\r\n', 'content', 3, 'Text k hotelu', 140, 0),
