(1296, 17, 14156, 'intro', 49, 'intro_content', '<p><span style=\"font-size:14px\"><strong>K &uacute;časti v soutěži V&aacute;m stač&iacute; nakoupit v prodejn&aacute;ch nebo na e-shopu HERVIS,&nbsp;vyplnit a odeslat registračn&iacute; formul&aacute;ř včetně zad&aacute;n&iacute; č&iacute;sla dokladu Va&scaron;eho n&aacute;kupu.&nbsp;Tak nev&aacute;hejte a hrajte s&nbsp;n&aacute;mi!​</strong><br />\r\nV&yacute;hry v soutěži:&nbsp;<br />\r\n<strong>2x zimn&iacute; pobyt pro 2 osoby na 4&nbsp;dny /&nbsp;3&nbsp;noci v 3* hotelu s polopenz&iacute; a dvěma skipasy v rakousk&eacute;m regionu Pyhrn-Priel.</strong><br />\r\nSoutěž prob&iacute;h&aacute; 1.11.2018&nbsp;- 30.11.2018&nbsp;na &uacute;zem&iacute; ČR.<br />\r\n<strong>Přejeme V&aacute;m hodně&nbsp;&scaron;těst&iacute; při odpovědi na soutěžn&iacute;&nbsp;ot&aacute;zku!</strong></span></p>\r\n', 'content', 2, 'Content', 0, 1),
