(1329, 57, 14159, 'registracia', 49, 'koniec_registracie', '<p>SOUTĚŽ BYLA UKONČENA DNE 1.11. 2016.</p>\r\n\r\n<p>Slosov&aacute;n&iacute; proběhlo dne 04.11.2016, ze v&scaron;ech přijat&yacute;ch platn&yacute;ch registrac&iacute; byli vybr&aacute;ni&nbsp; 3 v&yacute;herci dle pravidel soutěže. Dovolenkov&yacute; pobyt v Salzburgu pro 2 osoby na 4&nbsp;dny (3&nbsp;noci), ubytov&aacute;n&iacute; ve 3-4*hotelu se sn&iacute;dan&iacute;, včetně 3-denn&iacute; slevov&eacute; karty &bdquo;SalzburgCard&ldquo; z&iacute;sk&aacute;vaj&iacute; :</p>\r\n\r\n<p><strong>Tereza Seidlov&aacute;, 54701 N&aacute;chod, ČR</strong></p>\r\n\r\n<p><strong>Marie Herzogov&aacute;, 53701 Chrudim, ČR</strong></p>\r\n\r\n<p><strong>Gabriela Zpěv&aacute;kov&aacute;, 78313 &Scaron;těp&aacute;nov, ČR</strong></p>\r\n\r\n<p>V&yacute;herci budou kontaktov&aacute;ni provozovatelem soutěže ohledně převzet&iacute; pobytov&yacute;ch voucherů v nejbliž&scaron;&iacute;ch dnech. Pobytov&eacute; vouchery jsou platn&eacute; 31.10.2017, pobyty nezahrnujou dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;em děkujeme za &uacute;čast a v&yacute;hercům srdečne blahopřejeme!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnost a platnost slosov&aacute;n&iacute; potvrzuj&iacute; provozovatel&eacute; soutěže:<br />\r\nOrganiz&aacute;tor: TSG Tourismus Salzburg GmbH Auerspergstra&szlig;e 6, 5020 Salzburg, Rakousko<br />\r\na spoluorganiz&aacute;tor soutěže: GOLDTIME a.s., U Libeňsk&eacute;ho pivovaru 10, Praha 8, Česk&aacute; republika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 0),
(1330, 58, 14157, 'region', 49, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(1331, 59, 14157, 'region', 49, 'text_1', '<p><span style=\"font-size:14px\"><strong>TOP of Pyhrn-Priel&nbsp;<br />\r\n&hellip; takov&eacute; kr&aacute;sn&eacute;, takov&eacute; zasněžen&eacute; a tak bl&iacute;zko!&nbsp;</strong></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px\">1 skipas</span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-size:14px\">2 lyžařsk&eacute; </span>oblasti -&nbsp;<a href=\"https://www.urlaubsregion-pyhrn-priel.at/cz/rakousko/poi/203103/lyzaske-stedisko-hinterstoder---po-stopach-hvzd-svtoveho-poharu.html\" target=\"_blank\">Hinterstoder</a> a&nbsp;<a href=\"https://www.urlaubsregion-pyhrn-priel.at/cz/rakousko/poi/430001384/lyzaska-oblast-wurzeralm-spital-am-pyhrn---mj-zimni-svt.html\" target=\"_blank\">Wurzeralm</a></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-size:14px\"><span style=\"font-size:14px\">1000 možnost&iacute; aktivit</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:14px\">Připnout lyže, odp&iacute;chnout se a rozjet se: obě na&scaron;e lyžařsk&eacute; oblasti - Hinterstoder a Wurzeralm &ndash; poskytuj&iacute; n&aacute;dhern&eacute; lyžařsk&eacute; z&aacute;žitky, modern&iacute; a komfortn&iacute; lanovky bez ček&aacute;n&iacute; ve front&aacute;ch a d&iacute;ky nadmořsk&eacute; v&yacute;&scaron;ce tak&eacute; dostatek sněhu až do dubna!&nbsp;</span><span style=\"font-size:14px\">Ať si zvol&iacute;te z&aacute;vodn&iacute; sjezdovku nebo m&iacute;rn&yacute; svah pro zač&aacute;tečn&iacute;ky, v každ&eacute;m př&iacute;padě m&aacute;te k dispozici 60 km skvěle upraven&yacute;ch sjezdovek v&scaron;ech stupňů obt&iacute;žnosti. A k tomu velk&yacute; počet tradičn&iacute;ch horsk&yacute;ch chat s nab&iacute;dkou region&aacute;ln&iacute;ch specialit a terasami zalit&yacute;mi sluncem, odkud se otev&iacute;r&aacute; monument&aacute;ln&iacute; pohled na pohoř&iacute;.</span></p>\r\n', 'content', 2, 'Text 1', 0, 1),
(1332, 60, 14157, 'region', 49, 'text_2', '<p><span style=\"font-size:14px\">Rekreačn&iacute; oblast Pyhrn-Priel nab&iacute;z&iacute; tak&eacute; nesčetn&eacute; možnosti, jak b&yacute;t aktivn&iacute; a už&iacute;vat si zimy i bez lyž&iacute; či snowboardu.<br />\r\nU n&aacute;s budete naplno vn&iacute;mat kouzlo zimy!</span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:14px\">120 km běžeck&yacute;ch tras</span></li>\r\n	<li><span style=\"font-size:14px\">2 př&iacute;rodn&iacute; s&aacute;ňkařsk&eacute; dr&aacute;hy s uměl&yacute;m osvětlen&iacute;m</span></li>\r\n	<li><span style=\"font-size:14px\">100 km upraven&yacute;ch zimn&iacute;ch turistick&yacute;ch cest</span></li>\r\n	<li><span style=\"font-size:14px\">T&uacute;ry na sněžnic&iacute;ch a s pochodněmi</span></li>\r\n	<li><span style=\"font-size:14px\">Metan&aacute; na ledě</span></li>\r\n	<li><span style=\"font-size:14px\">2 kuželny &amp; kryt&eacute; baz&eacute;ny se saunami</span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:14px\">V&iacute;ce o rekreačn&iacute; oblasti Pyhr-Priel: </span><span style=\"font-size:16px\"><a href=\"https://www.urlaubsregion-pyhrn-priel.at/cz/zima/top-of-pyhrn-priel.html\" target=\"_blank\"><strong>www.topof.at</strong></a></span></p>\r\n', 'content', 2, 'Text 2', 0, 1),
