(1369, 199, 14162, 'partneri', 49, 'id_1_text', '<p><strong>Hervis Sports&nbsp;</strong>nab&iacute;z&iacute; sv&yacute;m z&aacute;kazn&iacute;kům &scaron;irok&yacute; v&yacute;běr sportovn&iacute;ho oblečen&iacute;, obuvi a vybaven&iacute; pro nejroz&scaron;&iacute;řeněj&scaron;&iacute; sporty jako je běh, fitness, cyklistika, outdoor, lyžov&aacute;n&iacute; a dal&scaron;&iacute;.<br />\r\nVe&nbsp;<a href=\"https://www.hervis.cz/store/store-finder?q=10100\" target=\"_blank\">25 prodejn&aacute;ch</a>&nbsp;zakoup&iacute;te produkty nejen světov&yacute;ch, ale i vlastn&iacute;ch značek jako je Benger, Cygnus, Kilimanjaro či X-Fact, kter&eacute; jsou přehledně uspoř&aacute;d&aacute;ny podle jednotliv&yacute;ch sportovn&iacute;ch odvětv&iacute; v tematick&yacute;ch nebo značkov&yacute;ch r&aacute;mech.<br />\r\nS v&yacute;běrem produktů stejně jako se servisem V&aacute;m pomohou na&scaron;i pro&scaron;kolen&iacute; zaměstnanci. Pro členy Hervis SportsClubu jsou nav&iacute;c připraven&eacute; speci&aacute;ln&iacute; nab&iacute;dky a odměny za n&aacute;kup.&nbsp;<strong>Tě&scaron;&iacute;me se na Va&scaron;i n&aacute;v&scaron;těvu!</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
