(1697, 16, 14156, 'intro', 52, 'intro_perex', '<p><span style=\"color:#FFFFFF\"><span style=\"font-size:20px\"><strong>NAKUPUJTE KILPI A VYHRAJTE SPORTOVN&Iacute; POBYT<br />\r\nV TRENDOV&Eacute;M EXPLORER HOTELS!</strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(1698, 17, 14156, 'intro', 52, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za jak&yacute;koliv n&aacute;kup oblečen&iacute; značky KILPI v na&scaron;ich kamenn&yacute;ch prodejn&aacute;ch KILPI stores v ČR a SR, nebo na někter&eacute;m z partnersk&yacute;ch e-shopů:</strong> <strong><a href=\"http://www.shopkilpi.cz\" target=\"_blank\">www.shopkilpi.cz</a> ; <a href=\"http://www.svetkilpi.cz\" target=\"_blank\">www.svetkilpi.cz</a> ; <a href=\"http://www.shopkilpi.sk\" target=\"_blank\">www.shopkilpi.sk</a> ; <a href=\"http://www.kilpi4you.com\" target=\"_blank\">www.kilpi4you.com</a></strong><br />\r\n<strong>m&aacute;te &scaron;anci vyhr&aacute;t skvělou dovolenou v jednom z trendovn&iacute;ch <a href=\"https://www.explorer-hotels.com/cz/deals/zima.html?utm_source=Kilpi&amp;utm_medium=Weiterleitung&amp;utm_campaign=Kilpi%20Kooperation%20M%C3%A4rz%202019\" target=\"_blank\">Explorer Hotels</a> v&nbsp;Rakousku nebo v&nbsp;Německu.</strong></span><br />\r\n<span style=\"font-size:14px\">V&yacute;hry v soutěži:&nbsp;</span><br />\r\n<strong>2x dovolen&aacute; pro 2 osoby na 4 dny / 3 noci včetně sn&iacute;daně, v zimě včetně skipasů, v jednom z <a href=\"https://www.explorer-hotels.com/cz/deals/zima.html?utm_source=Kilpi&amp;utm_medium=Weiterleitung&amp;utm_campaign=Kilpi%20Kooperation%20M%C3%A4rz%202019\" target=\"_blank\">Explorer Hotels</a> podle Va&scaron;eho v&yacute;běru. </strong>Pobyt je kromě dopravy. V&yacute;hru je možn&eacute; čerpat 1 rok od data vysatevn&iacute; poukazu, kromě hlavn&iacute; sezony a rakousk&yacute;ch sv&aacute;tků.<br />\r\n<span style=\"font-size:14px\"><strong>Soutěž prob&iacute;h&aacute; 1.3.2019&nbsp;- 31.3.2019&nbsp;na &uacute;zem&iacute; ČR a SR.&nbsp;</strong>Přejeme V&aacute;m hodně&nbsp;&scaron;těst&iacute; při odpovědi na soutěžn&iacute;&nbsp;ot&aacute;zku!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
