(1731, 57, 14159, 'registracia', 52, 'koniec_registracie', '<p>SOUTĚŽ BYLA UKONČENA DNE 31.3.2019.</p>\r\n\r\n<p>Slosov&aacute;n&iacute; proběhlo dne 02.04.2019, ze v&scaron;ech přijat&yacute;ch platn&yacute;ch registrac&iacute; byli dle pravidel soutěže vybr&aacute;ni&nbsp; 2&nbsp;v&yacute;herci. Dovolenkov&yacute; pobyt pro 2 osoby na 4 dny / 3 noci včetně sn&iacute;daně, v zimě tak&eacute; včetně skipasů, v jednom ze 3*** hotelů Explorer Hotels podle v&yacute;běru, v turistick&yacute;ch oblastech Rakouska nebo Německa, z&iacute;sk&aacute;vaj&iacute; :</p>\r\n\r\n<p><strong>M. Karkul&iacute;kov&aacute;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 568 02 Svitavy, ČR<br />\r\nJ. Machala&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 79601 Prostějov, ČR</strong></p>\r\n\r\n<p>V&yacute;herci budou kontaktov&aacute;ni provozovatelem soutěže ohledně převzet&iacute; pobytov&yacute;ch voucherů v nejbliž&scaron;&iacute;ch dnech. Pobytov&eacute; vouchery jsou platn&eacute; do 1.3.2020, pobyty nezahrnujou dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;em děkujeme za &uacute;čast a v&yacute;hercům srdečne blahopřejeme!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnost a platnost slosov&aacute;n&iacute; potvrzuj&iacute; provozovatel&eacute; soutěže:<br />\r\nExplorer Hotel St. Johann Verwaltung GmbH, Speckbacher Str. 87, 6380 St. Johann in Tirol, Rakousko&nbsp;<br />\r\na spoluorganiz&aacute;tor soutěže: PONATURE s.r.o., U Hrůbků 251/119, 709 00 Ostrava, Česk&aacute; republika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(1732, 58, 14157, 'region', 52, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(1733, 59, 14157, 'region', 52, 'text_1', '<p><strong>NEKOMPLIKOVAN&Eacute;, TRENDY &amp; V&Yacute;HODN&Eacute;</strong><br />\r\nOsm hotelů Explorer nach&aacute;zej&iacute;c&iacute;ch se uprostřed Alp je um&iacute;stěno nejen ve vhodn&eacute;, ale i cenově v&yacute;hodn&eacute; oblasti, ze kter&eacute; lze aktivně vyrazit do hor.<br />\r\nUvolněn&aacute; atmosf&eacute;ra, modern&iacute; design a sportovně aktivn&iacute; host&eacute; slibuj&iacute; pr&aacute;zdninovou atmosf&eacute;ru pro turisty - objevitele. Modern&iacute; designov&eacute; pokoje nab&iacute;zej&iacute; spoustu m&iacute;sta a &uacute;tuln&eacute; posezen&iacute; u okna s v&yacute;hledem na hory. Kdo bude cht&iacute;t, připrav&iacute; si u sn&iacute;daňov&eacute;ho bufetu sv&aacute; m&iacute;chan&aacute; vejce s&aacute;m, informuje se na interaktivn&iacute;ch dotykov&yacute;ch stěn&aacute;ch o nejlep&scaron;&iacute;ch t&uacute;r&aacute;ch a lyžařsk&yacute;ch středisc&iacute;ch. Po n&aacute;vratu z hor můžete večer relaxovat ve sportovn&iacute;ch l&aacute;zn&iacute;ch se saunou, parn&iacute; l&aacute;zn&iacute; a posilovnou. Pro fanou&scaron;ky zimn&iacute;ch sportů nab&iacute;z&iacute; Sporthotel lyžařsk&eacute; testovac&iacute; středisko s půjčovnou, kurzy a d&iacute;lnou.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(1734, 60, 14157, 'region', 52, 'text_2', '<p><span style=\"font-size:14px\"><strong>V&iacute;ce informac&iacute; nyn&iacute; naleznete na <a href=\"https://www.explorer-hotels.com/cz/deals/zima.html?utm_source=Kilpi&amp;utm_medium=Weiterleitung&amp;utm_campaign=Kilpi%20Kooperation%20M%C3%A4rz%202019\" target=\"_blank\">www.explorer-hotels.com/zima</a><br />\r\na objevte trendov&eacute; designov&eacute; levn&eacute; hotely v Oberstdorfu, Nesselwangu, Berchtesgadenu (DE) a v Montafonu, Zillertalu, Kitzb&uuml;helu, Hinterstoderu, &Ouml;tztalu (AT).</strong></span><br />\r\nV&yacute;hra v&nbsp;soutěži zahrnuje&nbsp;tak&eacute;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n&bull;&nbsp; &nbsp;&nbsp;Explorer Hotel dle va&scaron;eho v&yacute;běru<br />\r\n&bull;&nbsp; &nbsp; přenocov&aacute;n&iacute; v designov&eacute;m pokoji&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;vit&aacute;ln&iacute; sn&iacute;daně formou bufetu&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;sportovn&iacute; l&aacute;zně se saunou, parn&iacute; l&aacute;zně&nbsp; &nbsp;<br />\r\n&bull;&nbsp; &nbsp;&nbsp;infračervenou kabinu a posilovnu&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;Wi-Fi v cel&eacute;m hotelu&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;lyžařsk&eacute;&nbsp;testovac&iacute; středisko s d&iacute;lnou&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
