(1867, 57, 14159, 'registracia', 53, 'koniec_registracie', '<p>S&Uacute;ŤAŽ BOLA UKONČEN&Aacute;&nbsp;DŇA 31.3.2019.</p>\r\n\r\n<p>Žrebovanie prebehlo&nbsp;dňa&nbsp;02.04.2019, zo&nbsp;v&scaron;etk&yacute;ch&nbsp;prijat&yacute;ch platn&yacute;ch registr&aacute;ci&iacute;&nbsp;boli podľa&nbsp;pravidiel s&uacute;ťaže&nbsp;vybran&iacute;&nbsp; 2&nbsp;v&yacute;herci. Dovolenkov&yacute; pobyt pre&nbsp;2 osoby na 4 dni&nbsp;/ 3 noci vr&aacute;tane&nbsp;raňajok, v zime tiež vr&aacute;tane skipasov, v jednom z&nbsp;3*** hotelov&nbsp;Explorer Hotels podľa&nbsp;v&yacute;beru, v turistick&yacute;ch oblastiach&nbsp;Rak&uacute;ska&nbsp;alebo&nbsp;Nemecka, z&iacute;skavaj&uacute;&nbsp;:</p>\r\n\r\n<p><strong>M. Karkul&iacute;kov&aacute;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 568 02 Svitavy, ČR<br />\r\nJ. Machala&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 79601 Prostějov, ČR</strong></p>\r\n\r\n<p>V&yacute;herci bud&uacute;&nbsp;kontaktovan&iacute;&nbsp;organiz&aacute;torom&nbsp;s&uacute;ťaže&nbsp;ohľadom&nbsp;prevzatia&nbsp;pobytov&yacute;ch&nbsp;voucherov v najbliž&scaron;&iacute;ch&nbsp;dňoch. Pobytov&eacute; vouchery s&uacute;&nbsp;platn&eacute; do 1.3.2020, pobyty nezahŕńaj&uacute;&nbsp;dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;etk&yacute;m&nbsp;ďakujeme&nbsp;za &uacute;časť&nbsp;a v&yacute;hercom&nbsp;srdečne blahožel&aacute;me!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnosť&nbsp;a platnosť žrebovania&nbsp;potvrdzuj&uacute;&nbsp;organiz&aacute;tori&nbsp;s&uacute;ťaže:<br />\r\nExplorer Hotel St. Johann Verwaltung GmbH, Speckbacher Str. 87, 6380 St. Johann in Tirol, Rak&uacute;sko&nbsp;<br />\r\na spoluorganiz&aacute;tor soutěže: PONATUR</span><span style=\"font-size:12px\">E s.r.o., U Hrůbků 251/119, 709 00 Ostrava, Česk&aacute; re</span><span style=\"font-size:12px\">publika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(1868, 58, 14157, 'region', 53, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(1869, 59, 14157, 'region', 53, 'text_1', '<p><strong>NEKOMPLIKOVAN&Eacute;, TRENDY &amp; V&Yacute;HODN&Eacute;</strong><br />\r\nOsem hotelov Explorer nach&aacute;dzaj&uacute;cich sa uprostred &Aacute;lp je umiestnen&yacute;ch nielen vo vhodnej, ale aj cenovo v&yacute;hodnej oblasti, z ktorej je možn&eacute; akt&iacute;vne vyraziť do h&ocirc;r. Uvoľnen&aacute; atmosf&eacute;ra, modern&yacute; design a akt&iacute;vni hostia sľubuj&uacute; pr&aacute;zdninov&uacute; atmosf&eacute;ru pre turistov - objaviteľov. Modern&eacute; designov&eacute; izby pon&uacute;kaj&uacute; dostatok miesta a &uacute;tuln&eacute; posedenie s v&yacute;hľadom na hory. Kto bude chcieť, priprav&iacute; si s&aacute;m v r&aacute;mci raňajkov&eacute;ho bufetu mie&scaron;an&eacute; vaj&iacute;čka, na interakt&iacute;vnych dotykov&yacute;ch sten&aacute;ch sa informuje o t&uacute;rach a stredisk&aacute;ch. Po n&aacute;vrate z h&ocirc;r m&ocirc;žete večer relaxovať v &scaron;portov&yacute;ch k&uacute;peľoch so saunou, parnou k&uacute;peľou a posilňovňou. Pre fan&uacute;&scaron;ikov zimn&yacute;ch &scaron;portov pon&uacute;ka Sporthotel lyžiarske testovacie stredisko s požičovňou, dielňou aj lyžiarske kurzy.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(1870, 60, 14157, 'region', 53, 'text_2', '<p><span style=\"font-size:14px\"><strong>Viacej inform&aacute;ci&iacute;&nbsp;n&aacute;jdete&nbsp;na <a href=\"https://www.explorer-hotels.com/cz/deals/zima.html?utm_source=Kilpi&amp;utm_medium=Weiterleitung&amp;utm_campaign=Kilpi%20Kooperation%20M%C3%A4rz%202019\" target=\"_blank\">www.explorer-hotels.com/zima</a><br />\r\na objavujte&nbsp;trendov&eacute; designov&eacute; lacn&eacute;&nbsp;hotely v Oberstdorfe, Nesselwangu, Berchtesgadene&nbsp;(DE) a v Montafone, Zillertale, Kitzb&uuml;heli, Hinterstoderi, &Ouml;tztale (AT).</strong></span><br />\r\nV&yacute;hra v&nbsp;s&uacute;ťaži obsahuje okrem in&eacute;ho tiež&nbsp;<br />\r\n&bull;&nbsp; &nbsp;&nbsp;Explorer Hotel podľa&nbsp;va&scaron;eho v&yacute;beru&nbsp;<br />\r\n&bull;&nbsp; &nbsp; ubytovanie&nbsp;v designov&yacute;ch&nbsp;izb&aacute;ch&nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;vit&aacute;lne&nbsp;raňajky formou bufetu&nbsp; &nbsp;<br />\r\n&bull;&nbsp; &nbsp; &scaron;portov&eacute; parn&eacute; k&uacute;pele&nbsp;so&nbsp;saunou&nbsp; &nbsp;<br />\r\n&bull;&nbsp; &nbsp;&nbsp;infračerven&uacute;&nbsp;kab&iacute;nu a posilňovňu&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;Wi-Fi v celom&nbsp;hotely&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;lyžiarske&nbsp;testovacie&nbsp;centrum&nbsp;s dielňou&nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
