(2139, 16, 14156, 'intro', 55, 'intro_perex', '<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:22px\"><strong><span style=\"color:#FFFFFF\">VYHRAJTE WELLNESS POBYT PRE CEL&Uacute; RODINU!</span></strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(2140, 17, 14156, 'intro', 55, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za ak&yacute;koľvek&nbsp;n&aacute;kup&nbsp;v predajniach <a href=\"https://www.predeti.sk/predajne\" target=\"_blank\">predeti.sk</a>, alebo&nbsp;na e-shope <a href=\"https://www.predeti.sk/\" target=\"_blank\">www.predeti.sk</a>&nbsp;</strong><strong>m&aacute;te teraz &scaron;ancu&nbsp;vyhrať rodinn&yacute; wellness pobyt&nbsp;v&nbsp;k&uacute;peľoch Sonnentherme Lutzmannsburg&nbsp;v&nbsp;Rak&uacute;sku!</strong></span><br />\r\n<span style=\"font-size:14px\">V&yacute;hra&nbsp;v s&uacute;ťaži:&nbsp;</span><strong>1x rodinn&yacute; pobyt v Hoteli**** Sonnenpark,&nbsp;pre 2 dospel&yacute;ch a 2 deti (do 10 r.), ubytovanie na 4 dni / 3 noci, pln&aacute; penzia a nealko n&aacute;poje zo &ldquo;softbaru&rdquo;, vr&aacute;tane voľn&eacute;ho vstupu do k&uacute;peľov Sonnentherme a vstupu do hotelov&eacute;ho vodn&eacute;ho sveta. Ubytovanie v rodinn&yacute;ch izb&aacute;ch funkčne zariaden&yacute;ch pre b&aacute;b&auml;tk&aacute; a deti, zapožičanie k&uacute;pac&iacute;ch županov a&nbsp;uter&aacute;kov pre rodičov a deti, detsk&yacute;ch koč&iacute;kov a telef&oacute;nu, každodenn&aacute; starostlivosť o b&aacute;b&auml;tk&aacute; a deti vr&aacute;tane anim&aacute;cie pre b&aacute;b&auml;tk&aacute;, deti a rodičov.&nbsp;</strong><br />\r\nV&yacute;hru je možn&eacute; čerpať&nbsp;1 rok od d&aacute;tumu&nbsp;vysatevnia poukazu v z&aacute;vislosti od voľn&yacute;ch kapac&iacute;t hotelu, mimo letn&yacute;ch pr&aacute;zdnin, Vianočn&yacute;ch sviatkov a predĺžen&yacute;ch v&iacute;kendov.&nbsp;Pobyt nezahŕňa&nbsp;dopravu.<br />\r\n<span style=\"font-size:16px\"><strong>S&uacute;ťaž&nbsp;prebieha&nbsp;1.5.2019&nbsp;- 30.6.2019&nbsp;na &uacute;zem&iacute; SR.&nbsp;</strong>Prajeme V&aacute;m veľa&nbsp;&scaron;ťastia pri žrebovan&iacute;!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
