(2181, 199, 14162, 'partneri', 55, 'id_1_text', '<p><strong>Najn&aacute;kazlivej&scaron;&iacute; na svete je detsk&yacute; smiech.</strong> Toto pravidlo si potvrdzujeme každ&yacute; deň od chv&iacute;le, čo sme otvorili prv&uacute; predajňu predeti.sk. Dnes m&aacute;me otvoren&yacute;ch <a href=\"https://www.predeti.sk/predajne\" target=\"_blank\">12 predajn&iacute;</a> po celom Slovensku a doteraz v&aacute;s na&scaron;e produkty sprev&aacute;dzaj&uacute; v najkraj&scaron;ej životnej &ndash; rodičovskej role. Spolupracujeme so svetov&yacute;mi v&yacute;robcami, značkami a vyber&aacute;me pre v&aacute;s len tie najlep&scaron;ie veci od koč&iacute;kov cez autosedačky až po oblečenie a hračky. V&nbsp;spolupr&aacute;ci s pediatrami, certifikovan&yacute;mi p&ocirc;rodn&yacute;mi asistentkami a ďal&scaron;&iacute;mi odborn&iacute;kmi otvorili prv&eacute; profesion&aacute;lne matersk&eacute; centrum <a href=\"http://predeticare.sk/\" target=\"_blank\">Predeti care</a> v na&scaron;ej najv&auml;č&scaron;ej predajni v OC Korzo v Bratislave. Dnes tak&eacute;to centrum n&aacute;jdete aj&nbsp;v Trenč&iacute;ne a Nitre.&nbsp;<strong>Te&scaron;&iacute;me sa na každ&uacute; va&scaron;u n&aacute;v&scaron;tevu.</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
