(2199, 1493, 14358, 'hotely', 55, 'id_2_text', '<p>TUI BLUE PULSE Schladming je ide&aacute;ln&iacute; hotel pro aktivn&iacute; turisty, kteř&iacute; chtěj&iacute; str&aacute;vit svou dovolenou v hor&aacute;ch regionu Schladming-Dachstein. Modern&iacute; a funkčně zař&iacute;zen&eacute; hotelov&eacute; pokoje jsou ide&aacute;ln&iacute; z&aacute;kladnou pro to, abyste odpočat&iacute; nastartovali akčn&iacute; den. Pestr&eacute; sn&iacute;daně formou bufetu, večer bufet se sez&oacute;nn&iacute;mi region&aacute;ln&iacute;mi lahůdkami formou různ&yacute;ch hlavn&iacute;ch chodů, SkySauna, Wi-Fi v cel&eacute;m hotelu a &scaron;t&yacute;rsk&aacute; pohostinnost dopln&iacute; nab&iacute;dku v TUI BLUE PULSE.</p>\r\n', 'content', 3, '(<b>Hotel č. 2</b>) Text k hotelu 1', 1100, 0),
