(2275, 16, 14156, 'intro', 56, 'intro_perex', '<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:#FFFFFF\"><strong><span style=\"font-size:22px\">NYERJEN WELLNESS PIHEN&Eacute;ST CSAL&Aacute;DJ&Aacute;NAK!</span></strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(2276, 17, 14156, 'intro', 56, 'intro_content', '<p><strong><span style=\"font-size:16px\">V&aacute;s&aacute;roljon BABIEZ &uuml;zlet&uuml;nkben, vagy webshopunkban <a href=\"https://www.babiez.hu/\" target=\"_blank\">www.babiez.hu</a> , &eacute;s nyerjen egy wellness pihen&eacute;st az eg&eacute;sz csal&aacute;dnak a Hotel Sonnenpark****-ban, Sonnentherme, Ausztri&aacute;ban!</span></strong><br />\r\nA nyerem&eacute;ny t&aacute;rgya:&nbsp;<span style=\"font-size:14px\">&nbsp;</span><strong>1x csal&aacute;di &uuml;d&uuml;l&eacute;s 4 szem&eacute;ly r&eacute;sz&eacute;re, 3 &eacute;jszak&aacute;ra a Hotel Sonnenpark****-ban, 2 felnőtt &eacute;s 2 gyermek (10 &eacute;v alatti) r&eacute;sz&eacute;re, teljes ell&aacute;t&aacute;ssal &eacute;s &uuml;d&iacute;tőitalokkal. F&uuml;rdőbel&eacute;pők a Sonnentherme &eacute;lm&eacute;nyf&uuml;rdőbe a teljes tart&oacute;zkod&aacute;si idő alatt, valamint a sz&aacute;lloda v&iacute;zivil&aacute;g&aacute;nak haszn&aacute;lata, ahol garant&aacute;ljuk a nyug&aacute;gyakat minden vend&eacute;g&uuml;nk r&eacute;sz&eacute;re.</strong><br />\r\nAz &uuml;d&uuml;l&eacute;si utalv&aacute;ny a ki&aacute;ll&iacute;t&aacute;st&oacute;l sz&aacute;m&iacute;tott 1 &eacute;vig &eacute;rv&eacute;nyes, az utalv&aacute;ny &eacute;rv&eacute;nyess&eacute;gi ideje alatt b&aacute;rmikor felhaszn&aacute;lhat&oacute;, kiv&eacute;ve az ausztriai ny&aacute;ri sz&uuml;neteket, a kar&aacute;csonyi &uuml;nnepeket &eacute;s a meghosszabb&iacute;tott h&eacute;tv&eacute;g&eacute;ket.&nbsp;A nyerem&eacute;ny nem tartalmazza az utaz&aacute;si k&ouml;lts&eacute;geket.<br />\r\n<span style=\"font-size:16px\"><strong>A j&aacute;t&eacute;k 2019. m&aacute;jus.1-t&oacute;l 2019. j&uacute;nius 30-ig tart Magyarorsz&aacute;g ter&uuml;let&eacute;n.</strong><br />\r\nK&ouml;sz&ouml;nj&uuml;k r&eacute;szv&eacute;tel&eacute;t a nyerem&eacute;nyj&aacute;t&eacute;kban!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
