(2309, 57, 14159, 'registracia', 56, 'koniec_registracie', '<p>A NYEREM&Eacute;NYJ&Aacute;T&Eacute;K 2019.06.30-&Aacute;N V&Eacute;GET &Eacute;RT</p>\r\n\r\n<p>A versenyszab&aacute;lyzat szerint a ki&eacute;rt&eacute;kel&eacute;s 2019.07.04-&eacute;n lezajlott. A csal&aacute;di pihen&eacute;st, 2 felnőtt &eacute;s 2 gyermek (10 &eacute;ves korig) r&eacute;sz&eacute;re 4 nap / 3 &eacute;jszak&aacute;ra a Hotel**** Sonnenpark csal&aacute;dbar&aacute;t sz&aacute;llod&aacute;ban, teljes ell&aacute;t&aacute;ssal &eacute;s a Sonnentherme Lutzmannsburg &eacute;lm&eacute;nyf&uuml;rdő bel&eacute;pővel megnyerte:</p>\r\n\r\n<p><strong>Kov&aacute;cs A.,&nbsp; Győr 9026,&nbsp; Magyarorsz&aacute;g</strong></p>\r\n\r\n<p>A győztest az utalv&aacute;ny &aacute;tv&eacute;tel&eacute;ről az elk&ouml;vetkezendő napokban a nyerem&eacute;nyj&aacute;t&eacute;k szervezője &eacute;rtes&iacute;ti. Az utalv&aacute;ny a ki&aacute;ll&iacute;t&aacute;st&oacute;l sz&aacute;m&iacute;tott 1 &eacute;ven bel&uuml;l haszn&aacute;lhat&oacute; fel, a sz&aacute;lloda szabad helyeinek f&uuml;ggv&eacute;ny&eacute;ben (kiv&eacute;ve a kar&aacute;csonyi &uuml;nnepeket, az osztr&aacute;k ny&aacute;ri sz&uuml;netet &eacute;s a hossz&uacute; h&eacute;tv&eacute;g&eacute;ket). A nyerem&eacute;ny nem tartalmazza az odautaz&aacute;st.</p>\r\n\r\n<p><strong>Mindenkinek k&ouml;sz&ouml;nj&uuml;k a r&eacute;szv&eacute;telt, &eacute;s a nyertesnek sz&iacute;vből gratul&aacute;lunk.</strong></p>\r\n\r\n<p><span style=\"font-size:12px\">A sorsol&aacute;s &eacute;rv&eacute;nyess&eacute;g&eacute;t &eacute;s hiteless&eacute;g&eacute;t a nyerem&eacute;nyj&aacute;t&eacute;k szervezői garant&aacute;lj&aacute;k &eacute;s igazolj&aacute;k:<br />\r\nSonnentherme Lutzmannsburg-Frankenau GmbH, Thermengel&auml;nde 1, A - 7361 Lutzmannsburg<br />\r\nags92 kft. 9021 Győr, Kazinczy utca 5-7, Magyarorsz&aacute;g</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(2310, 58, 14157, 'region', 56, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(2311, 59, 14157, 'region', 56, 'text_1', '<p><strong>SONNENTHERME&nbsp;&ndash; CSAL&Aacute;DI PIHEN&Eacute;S<br />\r\nAUSZTRI&Aacute;BAN, LUTZMANNSBURGBAN.</strong><br />\r\n<strong>V&iacute;zi attrakci&oacute;k, gyerekprogramok, t&ouml;k&eacute;letes kikapcsol&oacute;d&aacute;s!</strong><br />\r\nAz ausztriai Sonnentherme baba- &eacute;s gyermekbar&aacute;t &eacute;lm&eacute;nyf&uuml;rdőj&eacute;ben megannyi sz&oacute;rakoz&aacute;s v&aacute;rja a kis- &eacute;s nagy vend&eacute;geket! A kisbab&aacute;k az egyed&uuml;l&aacute;ll&oacute; babav&iacute;zivil&aacute;g k&iacute;n&aacute;latban lelhetik &ouml;r&ouml;m&uuml;ket, a nagyobb gyerekek pedig a Fun World medenc&eacute;iben tombolhatj&aacute;k ki magukat. Itt &oacute;ri&aacute;scs&uacute;szd&aacute;k, ugr&oacute;tornyok, v&iacute;zi m&aacute;sz&oacute;fal &eacute;s term&aacute;lv&iacute;zes medenc&eacute;k garant&aacute;lj&aacute;k a sz&oacute;rakoz&aacute;st.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(2312, 60, 14157, 'region', 56, 'text_2', '<p>Ausztria leghosszabb fedett belt&eacute;ri cs&uacute;szd&aacute;ja is itt tal&aacute;lhat&oacute;, a 270 m hossz&uacute; &bdquo;XXL Monster Ride&ldquo; &eacute;s a vil&aacute;g leghoszabb Virtual Reality v&iacute;zics&uacute;szd&aacute;ja (202 m) is kipr&oacute;b&aacute;lhat&oacute;. A kisebbeket v&aacute;rja a homokos babastrand, az elektromos kishaj&oacute;k &eacute;s a kisvonat. A szabadt&eacute;ri sz&iacute;npad &eacute;s sz&aacute;mos egy&eacute;b attrakci&oacute; biztos&iacute;tj&aacute;k a t&ouml;k&eacute;letes csal&aacute;di kikapcsol&oacute;d&aacute;st kicsiknek &eacute;s nagyoknak!</p>\r\n', 'content', 2, 'Text 2', 0, 1),
