(2317, 199, 14162, 'partneri', 56, 'id_1_text', '<p>C&eacute;g&uuml;nk az ags92 kft. a Philips AVENT, Bright Starts, Boba &eacute;s Benbat nemzetk&ouml;zi m&aacute;rk&aacute;k magyarorsz&aacute;gi nagykereskedője.<br />\r\n21 &eacute;ves nemzetk&ouml;zi tapasztalattal rendelkez&uuml;nk babacikkek forgalmaz&aacute;s&aacute;ban.&nbsp;(Csehorsz&aacute;g, Szlov&aacute;kia, Magyarorsz&aacute;g)<br />\r\nAz &uuml;zleti csoportunk &eacute;vente t&ouml;bb mint 1 milli&oacute; term&eacute;ket forgalmaz.</p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
