(2327, 1485, 14358, 'hotely', 56, 'id_1_text', '<p><strong>A csal&aacute;dbar&aacute;t Hotel Sonnenpark</strong>**** sz&aacute;lloda saj&aacute;t v&iacute;zivil&aacute;ggal rendelkezik &eacute;s k&ouml;zvetlen &aacute;tj&aacute;r&oacute;val kapcsol&oacute;dik a Sonnentherme &eacute;lm&eacute;nyf&uuml;rdőh&ouml;z is. A csal&aacute;dbar&aacute;t hangulat&uacute; &eacute;s berendez&eacute;sű sz&aacute;lloda a bab&aacute;k, a gyermekek &eacute;s a sz&uuml;leik maxim&aacute;lis k&eacute;nyelm&eacute;t szolg&aacute;lja.<br />\r\nAz egyed&uuml;l&aacute;ll&oacute; Swim Academy professzion&aacute;lis &uacute;sz&aacute;soktat&aacute;st k&iacute;n&aacute;l m&aacute;r a legkisebbeknek is.<br />\r\nA kisbab&aacute;kat &eacute;s a gyerekeket a h&aacute;zigazda, Sunny Bunny a pl&uuml;ssny&uacute;l fogadja! J&aacute;tsz&oacute;szob&aacute;k, bark&aacute;csműhely, baba- &eacute;s gyerekmegőrz&eacute;s &eacute;s sz&aacute;mtalan gyerekprogram v&aacute;r a gyerekekre.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
