(2411, 16, 14156, 'intro', 57, 'intro_perex', '<p><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:#FFFFFF\"><span style=\"font-size:22px\"><strong>VYHRAJTE WELLNESS POBYT PRO CELOU RODINU!</strong></span></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(2412, 17, 14156, 'intro', 57, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za jak&yacute;koliv&nbsp;n&aacute;kup v prodejn&aacute;ch <a href=\"https://www.feedo.cz/prodejny/\" target=\"_blank\">Feedo<sup>&reg;</sup></a>, nebo na e-shopu <a href=\"https://www.feedo.cz/\" target=\"_blank\">www.feedo.cz</a>&nbsp;teď můžete vyhr&aacute;t&nbsp;rodinn&yacute; wellness pobyt v l&aacute;zn&iacute;ch Sonnentherme Lutzmannsburg&nbsp;v&nbsp;Rakousku!</strong></span><br />\r\n<span style=\"font-size:14px\">V&yacute;hra&nbsp;v soutěži:&nbsp;</span><strong>1x rodinn&yacute; pobyt v Hotelu**** Sonnenpark,&nbsp;pro&nbsp;2 dospěl&eacute;&nbsp;a 2 děti (do 10 let), ubytov&aacute;n&iacute;&nbsp;na 4 dny / 3 noci, pln&aacute; penze&nbsp;a nealko n&aacute;poje ze&nbsp;&ldquo;softbaru&rdquo;, včetně&nbsp;voln&eacute;ho vstupu do l&aacute;zn&iacute;&nbsp;Sonnentherme a vstupu do hotelov&eacute;ho vodn&iacute;ho&nbsp;světa. Ubytov&aacute;n&iacute; v rodinn&yacute;ch pokoj&iacute;ch&nbsp;funkčně&nbsp;zař&iacute;zen&yacute;ch pro miminka&nbsp;a děti, zapůjčen&iacute; koupac&iacute;ch županů&nbsp;a ručn&iacute;ků pro rodiče a děti, dětsk&yacute;ch koč&aacute;rků a telef&oacute;nu, každodenn&iacute; starostlivost o miminka a děti včetně animace pro miminka, děti a rodiče.</strong><br />\r\nV&yacute;hru lze&nbsp;čerpat&nbsp;1 rok od data vysataven&iacute;&nbsp;poukazu v z&aacute;vislosti na voln&eacute;&nbsp;kapacitě hotelu, kromě letn&iacute;ch&nbsp;pr&aacute;zdnin, V&aacute;nočn&iacute;ch sv&aacute;tků&nbsp;a prodloužen&yacute;ch v&iacute;kendů.&nbsp;Pobyt je kromě&nbsp;dopravy.<br />\r\n<span style=\"font-size:16px\"><strong>Soutěž prob&iacute;h&aacute;&nbsp;15.5.2019&nbsp;- 30.6.2019&nbsp;na &uacute;zem&iacute; ČR.&nbsp;</strong>Přejeme V&aacute;m hodně &scaron;těst&iacute; v soutěži!</span></p>\r\n', 'content', 2, 'Content', 0, 1);
