(2445, 57, 14159, 'registracia', 57, 'koniec_registracie', '<p>SOUTĚŽ&nbsp;BYLA UKONČENA&nbsp;DNE&nbsp;30.6.2019.</p>\r\n\r\n<p>Vyhodnocen&iacute; proběhlo dne 4.7.2019 dle pravidel soutěže.&nbsp;<strong>V&yacute;hru 1x rodinn&yacute; pobyt pro 2 dospěl&eacute; osoby a 2 děti (do 10 let) na 4 dny / 3 noci v Hotelu**** Sonnenpark, včetně pln&eacute; penze a voln&eacute;ho vstupu do l&aacute;zn&iacute; Sonnentherme Lutzmannsburg, z&iacute;sk&aacute;v&aacute;:</strong>&nbsp;&nbsp;</p>\r\n\r\n<p><strong>E. Schubertov&aacute;, 39301 Pelhřimov, ČR</strong></p>\r\n\r\n<p>V&yacute;herce bude kontaktov&aacute;n provozovatelem soutěže ohledně převzet&iacute; pobytov&eacute;ho voucheru v nejbliž&scaron;&iacute;ch dnech. Pobytov&yacute; voucher je platn&yacute;&nbsp;1 rok od data vystaven&iacute;, čerp&aacute;n&iacute; možn&eacute; dle voln&yacute;ch kapacit partnersk&eacute;ho hotelu (kromě V&aacute;nočn&iacute;ch sv&aacute;tků, rakousk&yacute;ch letn&iacute;ch pr&aacute;zdnin a prodloužen&yacute;ch v&iacute;kendů). Pobyt nezahrnuje dopravu.</p>\r\n\r\n<p><strong>V&scaron;em děkujeme za &uacute;čast a v&yacute;herci srdečne blahopřejeme!​<br />\r\n<em><span style=\"font-family:open sans,sans-serif; font-size:11pt\"><!--[endif]--></span></em></strong></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnost a platnost slosov&aacute;n&iacute; potvrzuj&iacute; provozovatel&eacute; soutěže:<br />\r\nSonnentherme Lutzmannsburg-Frankenau GmbH, Thermengel&auml;nde 1, 7361 Lutzmannsburg, Rakousko,<br />\r\na MyMedia s.r.o., Plask&aacute; 622/3, 150 00 Praha 5, ČR</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(2446, 58, 14157, 'region', 57, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(2447, 59, 14157, 'region', 57, 'text_1', '<p><strong>SONNENTHERME LUTZMANNSBURG<br />\r\n- L&Aacute;ZEŇSK&Yacute; R&Aacute;J PRO RODINNOU DOVOLENOU!</strong></p>\r\n\r\n<p><strong>Skvěl&eacute; atrakce, skvěl&yacute; program, skvěl&aacute; z&aacute;bava!</strong></p>\r\n\r\n<p>Předn&iacute; rakousk&eacute; l&aacute;zně pro mal&eacute; a vět&scaron;&iacute; děti Sonnentherme Lutzmannsburg s mnoha mega atrakcemi, skvěl&yacute;m programem a spoustou z&aacute;bavy pro sv&eacute; mal&eacute; a vět&scaron;&iacute; hosty. Čekaj&iacute; V&aacute;s jedinečn&eacute; a velkorys&eacute; vodn&iacute; světy &bdquo;Baby World&ldquo; a &bdquo;Fun World&ldquo; pro nekonč&iacute;c&iacute; z&aacute;bavu ve vodě.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(2448, 60, 14157, 'region', 57, 'text_2', '<p>Můžete si vyzkou&scaron;et &bdquo;Speed World&ldquo; s mega tobog&aacute;nem&nbsp; &bdquo;XXL Monster Ride&ldquo; (d&eacute;lka 270 m) a tak&eacute; na světe největ&scaron;&iacute; tobog&aacute;n s virtu&aacute;ln&iacute; realitou (d&eacute;lka 202 m). Četn&eacute; men&scaron;&iacute; skluzavky, inovativn&iacute; &scaron;kola plav&aacute;n&iacute;, Splash Pool se třemi odrazov&yacute;mi můstky a převisl&aacute; lezeck&aacute; stěna, dětsk&eacute; baz&eacute;ny s Baby Beach a p&iacute;skovou pl&aacute;ž&iacute;, elektro-čluny, dětsk&yacute; vl&aacute;ček, dětsk&aacute; z&aacute;žitkov&aacute; ar&eacute;na a dal&scaron;&iacute; skvěl&eacute; atrakce, to v&scaron;e je garanc&iacute; neomezen&yacute;ch z&aacute;žitků pro celou rodinu.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
