(2453, 199, 14162, 'partneri', 57, 'id_1_text', '<p><strong><a href=\"https://www.feedo.cz/\" target=\"_blank\">Feedo.cz</a> je tu pro v&scaron;echna miminka a jejich rodiče.</strong> Jsme největ&scaron;&iacute; specializovan&yacute; e-shop s kojeneckou v&yacute;živou a dětsk&yacute;m vybaven&iacute;m a nej&scaron;ir&scaron;&iacute;m sortimentem v Česk&eacute; republice. Od roku 2010 ulehčujeme v&aacute;m, rodičům, život. D&iacute;ky zaj&iacute;mav&yacute;m akc&iacute;m a doručen&iacute; až domů V&aacute;m &scaron;etř&iacute;me nejen pen&iacute;ze, ale i čas, kter&yacute; je pro rodiče snad to najcenněj&scaron;&iacute;.<br />\r\nJsme z&aacute;roveň specialistou v oblasti mateřstv&iacute;, kter&eacute;mu se věnujeme na na&scaron;ich str&aacute;nk&aacute;ch a soci&aacute;ln&iacute;ch s&iacute;t&iacute;ch. Každ&yacute; měs&iacute;c tak&eacute; poř&aacute;d&aacute;me semin&aacute;ře s odborn&iacute;ky na aktu&aacute;ln&iacute; t&eacute;mata a vyd&aacute;v&aacute;me vlastn&iacute; Feedo časopis. <strong>Nejsme jen e-shop!<br />\r\nJsme služba, kter&aacute; ulehčuje mamink&aacute;m život.</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
