(2463, 1485, 14358, 'hotely', 57, 'id_1_text', '<p><strong>****Hotel Sonnenpark, rodinn&yacute; relaxačn&iacute; hotel s př&iacute;m&yacute;m vstupem do l&aacute;zn&iacute; Sonnentherme Lutzmannsburg a exkluzivn&iacute;m hotelov&yacute;m vodn&iacute;m světem s garanc&iacute; m&iacute;sta k ležen&iacute; pro každ&eacute;ho, nab&iacute;z&iacute; exkluzivn&iacute; rodinnou dovolenou.</strong><br />\r\nZař&iacute;zen&iacute; hotelu poskytuje funkčnost pro rodiny. Inovativn&iacute; je zejm&eacute;na program plav&aacute;n&iacute; pro miminka a děti v term&aacute;ln&iacute; vodě se speci&aacute;lně vy&scaron;kolen&yacute;mi instruktory. Nab&iacute;dku hotelu doplňuje unik&aacute;tn&iacute; a z&aacute;bavn&yacute; hostitel Sunny Bunny - mil&aacute;ček každ&eacute;ho d&iacute;těte, oddělen&eacute; světy her a z&aacute;žitků pro různ&eacute; věkov&eacute; skupiny dět&iacute;, Sunny Bunny `s Home a d&iacute;lna, četn&eacute; dal&scaron;&iacute; nab&iacute;dky pro rodiny, celodenn&iacute; program pro miminka a děti zcela zdarma včetně &scaron;irok&eacute; nab&iacute;dky hl&iacute;d&aacute;n&iacute; miminek a dět&iacute;.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
