(2581, 57, 14159, 'registracia', 58, 'koniec_registracie', '<p>S&Uacute;ŤAŽ BOLA UKONČEN&Aacute;&nbsp;DŇA 30.6.2019.</p>\r\n\r\n<p>Vyhodnotenie prebehlo&nbsp;dňa&nbsp;04.07.2019 podľa&nbsp;pravidiel s&uacute;ťaže.&nbsp;<strong>V&yacute;hru 1x rodinn&yacute; pobyt pre 2 dospel&yacute;ch a 2 deti (do 10 r.)&nbsp; na 4 dni / 3 noci v Hoteli**** Sonnenpark, vr&aacute;tane plnej penzie a voľn&eacute;ho vstupu do k&uacute;peľov Sonnentherme Lutzmannsburg, z&iacute;skava: </strong>&nbsp;&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Z. &Scaron;časna, 94101 B&aacute;nov, SR</strong></span></p>\r\n\r\n<p>V&yacute;herca bude ohľadne prevzatia pobytov&eacute;ho voucheru kontaktovan&yacute; organiz&aacute;torom s&uacute;ťaže v najbliž&scaron;&iacute;ch dňoch. Pobytov&yacute; voucher je platn&yacute; 1 rok od d&aacute;tumu vystavenia, čerpanie možn&eacute; v z&aacute;vislosti od voľn&yacute;ch kapac&iacute;t partnersk&eacute;ho hotelu (mimo Vianočn&yacute;ch sviatkov, rak&uacute;skych letn&yacute;ch pr&aacute;zdnin a predĺžen&yacute;ch v&iacute;kendov). Pobyt nezahŕňa dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;etk&yacute;m&nbsp;ďakujeme&nbsp;za &uacute;časť&nbsp;a v&yacute;hercovi&nbsp;srdečne blahožel&aacute;me!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnosť&nbsp;a platnosť žrebovania&nbsp;potvrdzuj&uacute;&nbsp;organiz&aacute;tori&nbsp;s&uacute;ťaže:<br />\r\nSonnentherme Lutzmannsburg-Frankenau GmbH, Thermengel&auml;nde 1, 7361 Lutzmannsburg, Rak&uacute;sko,<br />\r\na MyMedia s.r.o., Plask&aacute; 622/3, 150 00 Praha 5, ČR</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(2582, 58, 14157, 'region', 58, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(2583, 59, 14157, 'region', 58, 'text_1', '<p><strong>SONNENTHERME LUTZMANNSBURG<br />\r\n- K&Uacute;PEĽN&Yacute; RAJ PRE RODINN&Uacute; DOVOLENKU!</strong></p>\r\n\r\n<p><strong>Skvel&eacute; atrakcie, skvel&yacute; program, skvel&aacute; z&aacute;bava!</strong><br />\r\n<br />\r\nPopredn&eacute; rak&uacute;ske k&uacute;pele pre mal&eacute; a v&auml;č&scaron;ie deti Sonnentherme Lutzmannsburg s množstvom mega atrakci&iacute;, skvel&yacute;m programom a super z&aacute;bavou pre svojich mal&yacute;ch a v&auml;č&scaron;&iacute;ch host&iacute;. Čakaj&uacute; V&aacute;s jedinečn&eacute; a veľkorys&eacute; vodn&eacute; svety &bdquo;Baby World&ldquo; a &bdquo;Fun World&ldquo; s nekončiacou z&aacute;bavou vo vode.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(2584, 60, 14157, 'region', 58, 'text_2', '<p>Vysk&uacute;&scaron;ať m&ocirc;žete &bdquo;Speed World&ldquo; s mega tobog&aacute;nom&nbsp; &bdquo;XXL Monster Ride&ldquo; (dĺžka 270 m) a tiež na svete najv&auml;č&scaron;&iacute; tobog&aacute;n s virtu&aacute;lnou realitou (dĺžka 202 m). S&uacute;časťou k&uacute;peľov je aj veľa men&scaron;&iacute;ch skĺzaviek, inovat&iacute;vna &scaron;kola pl&aacute;vania, Splash Pool s tromi odrazov&yacute;mi most&iacute;kmi a previsnut&aacute; lezeck&aacute; stena, detsk&eacute; baz&eacute;ny s Baby Beach a pieskovou pl&aacute;žou, elektro-člny, detsk&yacute; vl&aacute;čik, detsk&aacute; z&aacute;žitkov&aacute; ar&eacute;na a ďaľ&scaron;ie skvel&eacute; atrakcie, to v&scaron;etko je garanciou neobmedzen&yacute;ch z&aacute;žitkov pre cel&uacute; rodinu.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
