(2589, 199, 14162, 'partneri', 58, 'id_1_text', '<p><strong><a href=\"https://www.feedo.sk/\" target=\"_blank\">Feedo.sk</a> je tu pre v&scaron;etky b&aacute;b&auml;tk&aacute; a ich rodičov</strong>. Sme najv&auml;č&scaron;&iacute; &scaron;pecializovan&yacute; e-shop s dojčenskou v&yacute;živou a detsk&yacute;m vybaven&iacute;m a naj&scaron;ir&scaron;&iacute;m sortimentom na Slovensku. Od roku 2010 uľahčujeme v&aacute;m, rodičom, život.Vďaka zauj&iacute;mav&yacute;m akci&aacute;m a doručeniu až domov V&aacute;m &scaron;etr&iacute;me nielen peniaze, ale aj čas, ktor&yacute; je pre rodičov sn&aacute;ď to najcennej&scaron;ie.<br />\r\nSme z&aacute;roveň &scaron;pecialistom v oblasti materstva, ktor&eacute;mu sa venujeme na na&scaron;ich str&aacute;nkach a soci&aacute;lnych sieťach. Každ&yacute; mesiac tiež usporad&uacute;vame semin&aacute;re s odborn&iacute;kmi na aktu&aacute;lne t&eacute;my a vyd&aacute;vame vlastn&yacute; Feedo časopis. <strong>Nie sme len e-shop! Sme služba, ktor&aacute; uľahčuje mamičk&aacute;m život.</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
