(2599, 1485, 14358, 'hotely', 58, 'id_1_text', '<p><strong>****Hotel Sonnenpark, rodinn&yacute; relaxačn&yacute; hotel s priamym vstupom do k&uacute;peľov Sonnentherme Lutzmannsburg a exkluz&iacute;vnym hotelov&yacute;m vodn&yacute;m svetom s garanciou miesta na ležanie pre každ&eacute;ho, pon&uacute;ka exkluz&iacute;vnu rodinn&uacute; dovolenku.</strong><br />\r\nZariadenie hotelu poskytuje funkčnosť pre rodiny. Inovat&iacute;vny je najm&auml; program pl&aacute;vania pre b&aacute;b&auml;tk&aacute; a deti v term&aacute;lnej vode so &scaron;peci&aacute;lne vy&scaron;kolen&yacute;mi in&scaron;truktormi. Ponuku hotela dopĺňa unik&aacute;tny a z&aacute;bavn&yacute; hostiteľ Sunny Bunny - mil&aacute;čik každ&eacute;ho dieťaťa, oddelen&eacute; svety hier a z&aacute;žitkov pre r&ocirc;zne vekov&eacute; skupiny det&iacute;, Sunny Bunny `s Home s dielňou a ďaľ&scaron;ie ponuky pre rodiny, celodenn&yacute; program pre b&aacute;b&auml;tk&aacute; a deti &uacute;plne zdarma vr&aacute;tane &scaron;irokej ponuky opatrovania b&aacute;b&auml;tok a det&iacute;.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
