(2819, 16, 14156, 'intro', 60, 'intro_perex', '<p><span style=\"color:#FFFFFF\"><span style=\"font-size:22px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>WYGRAJ POBYT WELLNESS DLA CAŁEJ RODZINY!</strong></span></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(2820, 17, 14156, 'intro', 60, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za dowolny zakup w sklepie internetowym <a href=\"https://www.feedo.pl/\" target=\"_blank\">www.feedo.pl</a> masz teraz szansę wygrania rodzinnego pobytu wellness w ośrodku termalnym Sonnentherme Lutzmannsburg w Austrii!</strong></span><br />\r\n<span style=\"font-size:14px\">Nagroda w loterii: <strong>1x rodzinny pobyt w Hotelu**** Sonnenpark, dla 2 dorosłych os&oacute;b i 2 dzieci (do 10 r.ż.), zakwaterowanie na 5 dni / 4 noce, pełne wyżywienie i bezalkoholowe napoje z &bdquo;softbaru&rdquo;, w tym bezpłatny wstęp do ośrodka termalnego Sonnentherme i wstęp do hotelowego wodnego świata. Zakwaterowanie w funkcjonalnie urządzonych pokojach rodzinnych wyposażonych pod kątem dla niemowląt i dzieci, wypożyczenie szlafrok&oacute;w i ręcznik&oacute;w dla rodzic&oacute;w i dzieci, w&oacute;zk&oacute;w i telefonu, codzienna opieka nad niemowlętami i dziećmi, w tym animacje dla niemowląt, dzieci i rodzic&oacute;w.</strong><br />\r\nNagroda może zostać zrealizowana 1 rok od daty wydania vouchera, w zależności od wolnych miejsc w hotelu, poza wakacjami, świętami Bożego Narodzenia i długimi weekendami. Pobyt nie obejmuje transportu.</span><br />\r\n<span style=\"font-size:16px\"><strong>Loteria trwa&nbsp;w okresie 1.05.2019&nbsp;- 30.06.2019&nbsp;na terenie Polski.&nbsp;</strong>Życzymy szczęścia podczas losowania!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
