(2853, 57, 14159, 'registracia', 60, 'koniec_registracie', '<p>KONKURS ZAKOŃCZYŁ SIĘ&nbsp;30.06.2019</p>\r\n\r\n<p>Losowanie miało miejsce<strong>&nbsp;</strong>04.07.2019&nbsp;zgodnie z regułami loterii.&nbsp;<strong>Nagrod w loterii 1x rodzinny pobyt w Hotelu**** Sonnenpark, dla 2 dorosłych os&oacute;b i 2 dzieci (do 10 r.ż.), zakwaterowanie na 4 dni / 3 noce, pełne wyżywienie, w tym bezpłatny wstęp do ośrodka termalnego Sonnentherme </strong><strong>Lutzmannsburg, wygrywa:</strong></p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>A. Socha, 31-939 Krak&oacute;w, PL</strong></span></p>\r\n\r\n<p>Wygraną można zrealizować przez 1 rok od daty wystawienia bonu w zależności od wolnych pokoi w hotelu (poza świętami Bożego Narodzenia i długimi weekendami). Pobyt nie obejmuje transportu.</p>\r\n\r\n<p><strong>Dziękujemy za udział w loterii i gratulujemy zwycięzcom!​</strong></p>\r\n\r\n<p><span style=\"font-size:12px\">Organizatorzy loterii: Sonnentherme Lutzmannsburg-Frankenau GmbH i Hotel Sonnenpark, Thermengel&auml;nde 1, 7361 Lutzmannsburg, Austria. Wsp&oacute;łorganizator loterii: MyMedia s.r.o., Plask&aacute; 622/3, 150 00 Praga 5, Republika Czeska.</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(2854, 58, 14157, 'region', 60, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(2855, 59, 14157, 'region', 60, 'text_1', '<p><strong>SONNENTHERME LUTZMANNSBURG<br />\r\n&ndash; WAKACYJNY RAJ NA RODZINNY URLOP!</strong></p>\r\n\r\n<p><strong>Wspaniałe atrakcje, wspaniały program, wspaniała zabawa!</strong></p>\r\n\r\n<p>Wiodący austriacki ośrodek termalny Sonnentherme Lutzmannsburg dla małych i większych dzieci, z mn&oacute;stwem megaatrakcji, wspaniałym programem i superzabawą dla małych i większych gości.&nbsp;</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(2856, 60, 14157, 'region', 60, 'text_2', '<p>Czekają na Ciebie wyjątkowe i niezliczone światy wodne &bdquo;Baby World&rdquo; i &bdquo;Fun World&rdquo; z niekończącą się zabawą w wodzie, &bdquo;Speed World&rdquo; z megazjeżdżalnią &bdquo;XXL Monster Ride&rdquo; (dł. 270 m), a także największa na świecie zjeżdżalnia z rzeczywistością wirtualną (dł. 202 m). Wiele mniejszych ślizgawek, innowacyjna szkoła pływania, Splash Pool z trzema odskoczniami i wiszącą ścianą wspinaczkową, baseny dla dzieci z Baby Beach i piaszczystą plażą, elektryczne łodzie, pociąg dla dzieci, hala zabaw dla dzieci i inne wspaniałe atrakcje gwarantują nieograniczone doznania dla całej rodziny.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
