(2860, 198, 14162, 'partneri', 60, 'id_1_hotel_name', '', 'text', 3, 'Názov partnera', 0, 1),
(2861, 199, 14162, 'partneri', 60, 'id_1_text', '<p><strong><a href=\"https://www.feedo.pl/\" target=\"_blank\">Feedo.pl</a>&nbsp; - dbamy o&nbsp;mamy! </strong><br />\r\nJesteśmy największym specjalistycznym sklepem z żywnością dla niemowląt i produktami dla dzieci w Polsce. Od 2014 roku staramy się ułatwić Wam, rodzicom, życie. Dzięki ciekawym promocjom i dostawie do samego domu pomagamy Wam oszczędzać nie tylko pieniądze, ale i czas, kt&oacute;ry dla rodzic&oacute;w jest najcenniejszy. Jesteśmy jednocześnie specjalistami w dziedzinie macierzyństwa, kt&oacute;rym zajmujemy się na naszych stronach oraz w mediach społecznościowych. Co miesiąc organizujemy warsztaty z fachowcami z r&oacute;żnych dziedzin związanych z rodzicielstwem i wydajemy własne czasopismo.<br />\r\n<strong>Nie jesteśmy tylko sklepem internetowym! Naszą misją jest ułatwianie mamom życia.</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
