(2870, 1484, 14358, 'hotely', 60, 'id_1_hotel_name', '', 'text', 3, '(<b>Hotel č. 1</b>) Názov hotelu', 200, 1),
(2871, 1485, 14358, 'hotely', 60, 'id_1_text', '<p><strong>****Hotel Sonnenpark, rodzinny hotel relaksacyjny z bezpośrednim dostępem do osrodka termalnego Sonnentherme Lutzmannsburg i ekskluzywnego hotelowego świata wody z gwarancją miejsca do leżenia dla każdego, oferuje ekskluzywny rodzinny urlop.&nbsp;</strong><br />\r\nWyposażenie hotelu zapewnia funkcjonalność dla rodzin. Szczeg&oacute;lnie innowacyjny jest program pływania dla niemowląt i dzieci w wodzie termalnej ze specjalnie przeszkolonymi instruktorami. Ofertę hotelu uzupełnia wyjątkowy i zabawny gospodarz Sunny Bunny &ndash; ulubieniec każdego dziecka, osobne światy gier i przeżyć dla r&oacute;żnych grup wiekowych dzieci, Sunny Bunny`s Home z warsztatami i inne oferty dla rodziny, całodniowy program dla niemowląt i dzieci za darmo, w tym szeroka oferta opieki nad niemowlętami i dziećmi.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
