(2956, 17, 14156, 'intro', 61, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za&nbsp;jak&yacute;koliv n&aacute;kup oblečen&iacute; značky KILPI v na&scaron;ich kamenn&yacute;ch prodejn&aacute;ch KILPI stores v ČR a SR, nebo na někter&eacute;m z partnersk&yacute;ch e-shopů:</strong> <strong><a href=\"http://www.shopkilpi.cz\" target=\"_blank\">www.shopkilpi.cz</a> ; <a href=\"http://www.svetkilpi.cz\" target=\"_blank\">www.svetkilpi.cz</a> ; <a href=\"http://www.shopkilpi.sk\" target=\"_blank\">www.shopkilpi.sk</a> ; <a href=\"http://www.kilpi4you.com\" target=\"_blank\">www.kilpi4you.com</a></strong><br />\r\n<strong>m&aacute;te &scaron;anci vyhr&aacute;t skvělou dovolenou v jednom z trendovn&iacute;ch <a href=\"https://www.explorer-hotels.com/cz/nabidky/zima.html?utm_source=Kilpi%20CZ&amp;utm_medium=Kilpi%20CZ%20Winter%202019&amp;utm_term=10-2019%20Kilpi%20Kampagne%20CZ\" target=\"_blank\">Explorer Hotels</a> v&nbsp;Rakousku nebo v&nbsp;Německu.</strong></span><br />\r\n<span style=\"font-size:14px\">V&yacute;hry v soutěži:&nbsp;</span><br />\r\n<strong>2x dovolen&aacute; pro 2 osoby na 4 dny / 3 noci včetně sn&iacute;daně a&nbsp;jedn&eacute; zimn&iacute; aktivity ( běh na lyž&iacute;ch nebo pochod na sněžnic&iacute;ch, vč. zapůjčen&iacute; v&yacute;stroje) podle Va&scaron;eho v&yacute;běru, v jednom z&nbsp;</strong><strong><a href=\"https://www.explorer-hotels.com/cz/nabidky/zima.html?utm_source=Kilpi%20CZ&amp;utm_medium=Kilpi%20CZ%20Winter%202019&amp;utm_term=10-2019%20Kilpi%20Kampagne%20CZ\" target=\"_blank\">Explorer Hotels</a>&nbsp;.</strong><br />\r\nPobyt je kromě dopravy. V&yacute;hru je možn&eacute; čerpat 1 rok od data vysatevn&iacute; poukazu, kromě v&aacute;nočn&iacute;ch a novoročn&iacute;ch pr&aacute;zdnin a rakousk&yacute;ch sv&aacute;tků.<br />\r\n<span style=\"font-size:14px\"><strong>Soutěž prob&iacute;h&aacute; 15.10.2019&nbsp;- 30.11.2019&nbsp;na &uacute;zem&iacute; ČR a SR.&nbsp;</strong>Přejeme V&aacute;m hodně&nbsp;&scaron;těst&iacute; v soutěži!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
