(2997, 199, 14162, 'partneri', 61, 'id_1_text', '<p><strong>KILPI - TESTOV&Aacute;NO SEVEREM A PROVĚŘENO LIDMI</strong><br />\r\nPřijali jsme v&yacute;zvu severu a vytvořili značku outdoorov&eacute;ho oblečen&iacute; a doplňků Kilpi.&nbsp; Jsou testov&aacute;ny severem, jeho nespoutanost&iacute;, hrdost&iacute; a nekompromisn&iacute;mi n&aacute;roky země mytick&yacute;ch hrdinů. Pokud chcete zimu doopravdy prož&iacute;t, mus&iacute;te na ni b&yacute;t připraven&iacute;. Kilpi znamen&aacute; finsky &scaron;t&iacute;t. Tam, kde si př&iacute;roda i domy svou obranu už vybudovaly, potřebujete ji i vy. Spolehněte se na&nbsp;<a href=\"http://www.kilpi.cz/cs/o-kilpi/siberium-kilpi\" target=\"_blank\">oblečen&iacute; a doplňky Kilpi</a>. Budou va&scaron;&iacute;m &scaron;t&iacute;tem, d&iacute;ky kter&eacute;mu budete v bezpeč&iacute; a ochr&aacute;něni.<br />\r\nV sortimentu Kilpi najdete kompletn&iacute; v&yacute;bavu pro zimu i l&eacute;to, doplňky i maličkosti. Obl&eacute;knete se do př&iacute;rody i do města, na sportov&aacute;n&iacute; i pro okamžiky odpočinku. Vybav&iacute;me v&aacute;s &uacute;čelov&yacute;mi a designov&yacute;mi bundami, skvěle padnouc&iacute;mi kalhotami, funkčn&iacute;m pr&aacute;dlem i stylov&yacute;mi tričky. A když mrazivou zimu vystř&iacute;d&aacute; žhav&eacute; l&eacute;to, vyt&aacute;hnete k vodě na&scaron;e plavky i dal&scaron;&iacute; letn&iacute; v&yacute;bavu.</p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
