(3091, 16, 14156, 'intro', 62, 'intro_perex', '<p><span style=\"color:#FFFFFF\"><span style=\"font-size:20px\"><strong>NAKUPUJTE KILPI A VYHRAJTE &nbsp;&Scaron;PORTOV&Yacute; POBYT<br />\r\nV TRENDOVOM EXPLORER HOTELS!</strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(3092, 17, 14156, 'intro', 62, 'intro_content', '<p><span style=\"font-size:16px\"><strong>Za ak&yacute;koľvek&nbsp;n&aacute;kup oblečenia&nbsp;značky KILPI v na&scaron;ich kamenn&yacute;ch predajniach&nbsp;KILPI stores v SR a ČR, alebo&nbsp;na niektorom z partnersk&yacute;ch e-shopov:</strong> <strong><a href=\"http://www.shopkilpi.cz\" target=\"_blank\">www.shopkilpi.cz</a> ; <a href=\"http://www.svetkilpi.cz\" target=\"_blank\">www.svetkilpi.cz</a> ; <a href=\"http://www.shopkilpi.sk\" target=\"_blank\">www.shopkilpi.sk</a> ; <a href=\"http://www.kilpi4you.com\" target=\"_blank\">www.kilpi4you.com</a></strong><br />\r\n<strong>m&aacute;te &scaron;ancu&nbsp;vyhrať skvel&uacute;&nbsp;dovolenku v jednom z trendov&yacute;ch <a href=\"https://www.explorer-hotels.com/cz/nabidky/zima.html?utm_source=Kilpi%20CZ&amp;utm_medium=Kilpi%20CZ%20Winter%202019&amp;utm_term=10-2019%20Kilpi%20Kampagne%20CZ\" target=\"_blank\">Explorer Hotels</a> v&nbsp;Rak&uacute;sku alebo v&nbsp;Nemecku.</strong></span><br />\r\n<span style=\"font-size:14px\">V&yacute;hry v s&uacute;ťaži:&nbsp;</span><br />\r\n<strong>2x dovolenka&nbsp;pre&nbsp;2 osoby na 4 dni&nbsp;/ 3 noci vr&aacute;tane&nbsp;raňajok a jednej zimnej aktivity (beh na lyžiach alebo pochod na snežniciach), v jednom z <a href=\"https://www.explorer-hotels.com/cz/nabidky/zima.html?utm_source=Kilpi%20CZ&amp;utm_medium=Kilpi%20CZ%20Winter%202019&amp;utm_term=10-2019%20Kilpi%20Kampagne%20CZ\" target=\"_blank\">Explorer Hotels</a> podľa&nbsp;Va&scaron;eho v&yacute;beru. </strong>Pobyt je okrem&nbsp;dopravy. V&yacute;hru je možn&eacute; čerpať&nbsp;1 rok od d&aacute;tumu&nbsp;vysatevnia poukazu, mimo vianočn&yacute;ch a novoročn&yacute;ch pr&aacute;zdnin a rak&uacute;skych sviatkov.<br />\r\n<span style=\"font-size:14px\"><strong>S&uacute;ťaž&nbsp;prebieha&nbsp;15.10.2019&nbsp;- 30.11.2019&nbsp;na &uacute;zem&iacute; SR a ČR.&nbsp;</strong>Prajeme V&aacute;m veľa&nbsp;&scaron;ťastia v s&uacute;ťaži!</span></p>\r\n', 'content', 2, 'Content', 0, 1),
