(3125, 57, 14159, 'registracia', 62, 'koniec_registracie', '<p>S&Uacute;ŤAŽ BOLA UKONČEN&Aacute;&nbsp;DŇA 30.11.2019.</p>\r\n\r\n<p>Žrebovanie prebehlo&nbsp;dňa&nbsp;04.12.2019, zo&nbsp;v&scaron;etk&yacute;ch&nbsp;prijat&yacute;ch platn&yacute;ch registr&aacute;ci&iacute;&nbsp;boli podľa&nbsp;pravidiel s&uacute;ťaže&nbsp;vybran&iacute;&nbsp; 2&nbsp;v&yacute;herci. &Scaron;portov&yacute;&nbsp;pobyt pre&nbsp;2 osoby na 4 dni&nbsp;/ 3 noci vr&aacute;tane&nbsp;raňajok a jednej zimnej aktivity (beh na lyžiach alebo pochod na snežniciach) v jednom z 3*** hotelov Explorer Hotels podľa&nbsp;v&yacute;beru, v turistick&yacute;ch oblastiach Rak&uacute;ska alebo Nemecka, z&iacute;skavaj&uacute;&nbsp;:</p>\r\n\r\n<p><strong>Pavel Chorobik, ČR<br />\r\nIveta Matou&scaron;kov&aacute;,&nbsp;ČR</strong></p>\r\n\r\n<p>V&yacute;herci bud&uacute;&nbsp;kontaktovan&iacute;&nbsp;organiz&aacute;torom&nbsp;s&uacute;ťaže&nbsp;ohľadom&nbsp;prevzatia&nbsp;pobytov&yacute;ch&nbsp;voucherov v najbliž&scaron;&iacute;ch&nbsp;dňoch. Pobytov&eacute; vouchery s&uacute;&nbsp;platn&eacute; do 30.11.2020, pobyty nezahŕńaj&uacute;&nbsp;dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;etk&yacute;m&nbsp;ďakujeme&nbsp;za &uacute;časť&nbsp;a v&yacute;hercom&nbsp;srdečne blahožel&aacute;me!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnosť&nbsp;a platnosť žrebovania&nbsp;potvrdzuj&uacute;&nbsp;organiz&aacute;tori&nbsp;s&uacute;ťaže:<br />\r\nExplorer Hotel St. Johann Verwaltung GmbH, Speckbacher Str. 87, 6380 St. Johann in Tirol, Rak&uacute;sko&nbsp;<br />\r\na spoluorganiz&aacute;tor soutěže: PONATUR</span><span style=\"font-size:12px\">E s.r.o., U Hrůbků 251/119, 709 00 Ostrava, Česk&aacute; re</span><span style=\"font-size:12px\">publika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
