(3127, 59, 14157, 'region', 62, 'text_1', '<p><strong>NEKOMPLIKOVAN&Eacute;, TRENDY &amp; V&Yacute;HODN&Eacute;</strong><br />\r\nDev&auml;ť&nbsp;hotelov Explorer nach&aacute;dzaj&uacute;cich sa uprostred &Aacute;lp je umiestnen&yacute;ch nielen vo vhodnej, ale aj cenovo v&yacute;hodnej oblasti, z ktorej je možn&eacute; akt&iacute;vne vyraziť do h&ocirc;r. Uvoľnen&aacute; atmosf&eacute;ra, modern&yacute; design a akt&iacute;vni hostia sľubuj&uacute; pr&aacute;zdninov&uacute; atmosf&eacute;ru pre turistov - objaviteľov. Modern&eacute; designov&eacute; izby pon&uacute;kaj&uacute; dostatok miesta a &uacute;tuln&eacute; posedenie s v&yacute;hľadom na hory. Kto bude chcieť, priprav&iacute; si s&aacute;m v r&aacute;mci raňajkov&eacute;ho bufetu mie&scaron;an&eacute; vaj&iacute;čka, na interakt&iacute;vnych dotykov&yacute;ch sten&aacute;ch sa informuje o t&uacute;rach a stredisk&aacute;ch. Po n&aacute;vrate z h&ocirc;r m&ocirc;žete večer relaxovať v &scaron;portov&yacute;ch k&uacute;peľoch so saunou, parnou k&uacute;peľou a posilňovňou. Pre fan&uacute;&scaron;ikov zimn&yacute;ch &scaron;portov pon&uacute;ka Sporthotel lyžiarske testovacie stredisko s požičovňou, dielňou aj lyžiarske kurzy.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(3128, 60, 14157, 'region', 62, 'text_2', '<p><span style=\"font-size:14px\"><strong>Viacej inform&aacute;ci&iacute;&nbsp;n&aacute;jdete&nbsp;na <a href=\"https://www.explorer-hotels.com/cz/nabidky/zima.html?utm_source=Kilpi%20CZ&amp;utm_medium=Kilpi%20CZ%20Winter%202019&amp;utm_term=10-2019%20Kilpi%20Kampagne%20CZ\" target=\"_blank\">www.explorer-hotels.com/zima</a>&nbsp;a objavujte&nbsp;trendov&eacute; designov&eacute; lacn&eacute;&nbsp;hotely v Oberstdorfe, Nesselwangu, Berchtesgadene&nbsp;(DE) a v Montafone, Zillertale, Kitzb&uuml;heli, Hinterstoderi, &Ouml;tztale, </strong></span><strong>od decembra&nbsp;2019 tiež&nbsp;v Bad Kleinkirchheim&nbsp;(AT)</strong><span style=\"font-size:14px\"><strong>.</strong></span><br />\r\n<br />\r\nPobyt v Explorer Hotels&nbsp;obsahuje:<br />\r\n&bull;&nbsp; &nbsp; ubytovanie&nbsp;v designov&yacute;ch&nbsp;izb&aacute;ch&nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;vit&aacute;lne&nbsp;raňajky formou bufetu&nbsp; &nbsp;<br />\r\n&bull;&nbsp; &nbsp; &scaron;portov&eacute; parn&eacute; k&uacute;pele&nbsp;so&nbsp;saunou&nbsp; &nbsp;<br />\r\n&bull;&nbsp; &nbsp;&nbsp;infračerven&uacute;&nbsp;kab&iacute;nu a posilňovňu&nbsp; &nbsp;<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;lbeh na lyžiach alebo pochod na snežniciach<br />\r\n&bull;&nbsp;&nbsp;&nbsp;&nbsp;Wi-Fi v celom&nbsp;hotely&nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'content', 2, 'Text 2', 0, 1),
