(3133, 199, 14162, 'partneri', 62, 'id_1_text', '<p><strong><span style=\"font-family:arial,sans-serif; font-size:10pt\">KILPI - TESTOVAN&Eacute; SEVEROM A PREVEREN&Eacute; ĽUĎMI</span></strong><br />\r\nPrijali sme v&yacute;zvu severu a vytvorili značku outdoorov&eacute;ho oblečenia a doplnkov Kilpi. S&uacute; testovan&eacute; severom, jeho nesp&uacute;tanosťou, hrdosťou a nekompromisn&yacute;mi n&aacute;rokmi krajiny m&yacute;tick&yacute;ch hrdinov. Ak chcete zimu zažiť naozaj, mus&iacute;te na ňu byť pripraven&iacute;. Kilpi znamen&aacute; v preklade f&iacute;nsky &scaron;t&iacute;t. Tam, kde si pr&iacute;roda aj domy svoju obranu už vybudovali, potrebujete ju aj vy. Na <a href=\"https://www.kilpi.cz/cs/o-kilpi/siberium-kilpi\">oblečenie a doplnky Kilpi</a> sa m&ocirc;žete spoľahn&uacute;ť. Bud&uacute; va&scaron;&iacute;m &scaron;t&iacute;tom, vďaka ktor&eacute;mu budete v bezpeč&iacute; a chr&aacute;nen&iacute;.<br />\r\nV sortimente Kilpi n&aacute;jdete kompletn&uacute; v&yacute;bavu na zimu aj leto, doplnky a r&ocirc;zne maličkosti. Oblečiete sa do pr&iacute;rody aj do mesta, na &scaron;port aj na chv&iacute;le odpočinku. Vybav&iacute;me v&aacute;s &uacute;čelov&yacute;mi a dizajnov&yacute;mi bundami, skvele padn&uacute;cimi nohavicami, funkčnou bielizňou, aj &scaron;t&yacute;lov&yacute;mi tričkami. A keď mraziv&uacute; zimu vystrieda sparn&eacute; leto, vytiahnete k vode na&scaron;e plavky a ďal&scaron;iu letn&uacute; v&yacute;bavu.</p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
