(3228, 17, 14156, 'intro', 63, 'intro_content', '<p><span style=\"font-size:18px\"><span style=\"color:#990000\"><strong>VYHRAJTE&nbsp;S INTERSPORTEM&nbsp;T&Yacute;DENN&Iacute; POBYT PRO DVA VČETNĚ SKIPASŮ DO ZILLERTALU!</strong></span></span><br />\r\n<span style=\"font-size:18px\"><span style=\"color:#990000\">Sledujte n&aacute;&scaron;&nbsp;</span><strong><u><a href=\"https://www.facebook.com/INTERSPORT.CZ\" target=\"_blank\"><span style=\"color:rgb(153, 0, 0)\">facebook/www.intersport.cz</span></a></u><span style=\"color:rgb(153, 0, 0)\">&nbsp;</span></strong><br />\r\n<span style=\"color:rgb(153, 0, 0)\">Pro &uacute;čast v soutěži v&aacute;m stač&iacute; napsat odpověď na na&scaron;i ot&aacute;zku na facebooku.&nbsp;<a href=\"https://www.facebook.com/INTERSPORT.CZ/\" target=\"_blank\"><img alt=\"\" src=\"http://zill-intersportcz-10-2019.winprizes.eu/dnt-view/data/uploads/63_5ffb7c2b4983ba079d930d6d789b1703_o.png\" style=\"height:25px; width:25px\" /></a></span></span><br />\r\n<span style=\"color:rgb(153, 0, 0); font-size:18px\">Soutěž prob&iacute;h&aacute;&nbsp;v s&iacute;ti Intersport ČR. <a href=\"https://www.facebook.com/notes/intersport-%C4%8Desk%C3%A1-republika/sout%C4%9B%C5%BE-o-t%C3%BDdenn%C3%AD-pobyt-v-rakousk%C3%A9m-regionu-zillertal/2878433025513869/\" target=\"_blank\">Pravidla soutěže ZDE.</a></span><br />\r\n<span style=\"font-size:16px\"><strong><span style=\"color:rgb(153, 0, 0)\">V&yacute;hra&nbsp;v soutěži:</span></strong><span style=\"color:#800000\"><strong>&nbsp;1x t&yacute;denn&iacute; lyžařsk&yacute; pobyt pro 2 osoby, zahrnuje ubytovan&iacute; na 7 noc&iacute; ve 4* hotelu s polopenz&iacute; včetně dvou 6 denn&iacute;ch skipasů v rakousk&eacute;m regionu Zillertal.&nbsp;</strong>Pobytov&yacute; voucher plat&iacute; v zimn&iacute; sezoně 2019/20, čerp&aacute;n&iacute; možn&eacute; do 07.12.2019 do 19.04.2020 (kromě v&aacute;nočn&iacute;ch a novoročn&iacute;ch pr&aacute;zdnin a rakousk&yacute;ch sv&aacute;tků).&nbsp; Pobyt je kromě dopravy. Term&iacute;n čerp&aacute;n&iacute; bude upřesněn mezi v&yacute;hercem a poskytovatelem pobytu, dle voln&yacute;ch kapacit partnersk&eacute;ho hotelu.</span></span></p>\r\n', 'content', 2, 'Content', 0, 1),
