(3262, 58, 14157, 'region', 63, 'name', '', 'text', 2, 'Názov v rámci stránky', 0, 0),
(3263, 59, 14157, 'region', 63, 'text_1', '<p><strong>Přijeďte<span style=\"font-size:10px\"> </span>k<span style=\"font-size:10px\"> </span>n&aacute;m.<span style=\"font-size:10px\"> </span>Vn&iacute;mejte<span style=\"font-size:10px\"> </span>pohodu.<span style=\"font-size:10px\"> </span>Už&iacute;vejte<span style=\"font-size:10px\"> </span>si.</strong></p>\r\n\r\n<p>Naprosto nekonečn&eacute; sjezdovky, zasněžen&eacute; svahy, fascinuj&iacute;c&iacute; horsk&yacute; svět a prvn&iacute; stopy ve sněhu &ndash; co může b&yacute;t v zimě kr&aacute;sněj&scaron;&iacute;ho! Na 535 kilometrech sjezdovek v&aacute;m Zillertal nab&iacute;z&iacute; ryz&iacute; z&aacute;bavu ve sněhu &ndash; s př&iacute;jemn&yacute;mi carvingov&yacute;mi trasami, dlouh&yacute;mi sportovn&iacute;mi sjezdy do &uacute;dol&iacute; a n&aacute;ročn&yacute;mi trasami pro opravdov&eacute; znalce.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(3264, 60, 14157, 'region', 63, 'text_2', '<p>Jeden&aacute;ct trat&iacute; funline se postar&aacute; o z&aacute;bavu mlad&yacute;ch&nbsp;i star&scaron;&iacute;ch. Ten, kdo m&aacute; r&aacute;d adrenalinov&eacute; sporty, může kromě toho svou&nbsp;energii vyb&iacute;t v osmi snowparc&iacute;ch a na nespočetn&yacute;ch snadno dostupn&yacute;ch freeride&nbsp;tras&aacute;ch. Zkr&aacute;tka a dobře: Ve čtyřech rekreačn&iacute;ch regionech Zillertalu &ndash;&nbsp;F&uuml;gen-Kaltenbach, Zell-Gerlos, Mayrhofen-Hippach a Tux-Finkenberg &ndash; najde&nbsp;každ&yacute; zimn&iacute; sportovec to, co hled&aacute;: ide&aacute;ln&iacute; ter&eacute;n, perfektně upraven&eacute;&nbsp;sjezdovky a samozřejmě kulin&aacute;řsk&eacute; dobroty, kter&eacute; potě&scaron;&iacute; chuťov&eacute; buňky.</p>\r\n', 'content', 2, 'Text 2', 0, 1),
