(3268, 198, 14162, 'partneri', 63, 'id_1_hotel_name', 'Hotel Neuhintertux ', 'text', 3, 'Názov partnera', 0, 1),
(3269, 199, 14162, 'partneri', 63, 'id_1_text', '<p><strong>Partnersk&yacute; hotel soutěže</strong><br />\r\n<br />\r\nHotel Neuhintertux se nach&aacute;z&iacute; na ide&aacute;ln&iacute;m m&iacute;stě, hned vedle &uacute;doln&iacute; stanice ledovce - od n&iacute; je vzd&aacute;len jen 50m.<br />\r\n<br />\r\nZažijte rodinnou atmosf&eacute;ru, vrchol kulin&aacute;řsk&eacute;ho uměn&iacute; a oddechovou relaxaci v na&scaron;ich kr&aacute;sn&yacute;ch l&aacute;zn&iacute;ch s horsk&yacute;m panoramatem. Na ide&aacute;ln&iacute;m m&iacute;stě, př&iacute;mo v &uacute;dol&iacute;, 50 m od stanice ledovce.&nbsp;<br />\r\n<br />\r\nJste zv&aacute;ni do 64 pokojů, suit a apartm&aacute;nů pro p&aacute;ry, jednotlivce a rodiny do hotelu Neuhintertux ke sněn&iacute; a relaxaci.<br />\r\n<br />\r\nVoda, led a teplo jsou &bdquo;př&iacute;sadami&ldquo; wellness centra: Plaveck&yacute; baz&eacute;n a whirlpool, sauny a ledov&eacute; font&aacute;ny, l&eacute;čebn&eacute; l&aacute;zeňsk&eacute; a kosmetick&eacute; procedury umožňuj&iacute; blahod&aacute;rnou souhru, kter&aacute; h&yacute;čk&aacute; a obohacuje tělo, mysl a du&scaron;i.</p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
