(3279, 1485, 14358, 'hotely', 63, 'id_1_text', '<p>Ve čtyřech lyžařsk&yacute;ch oblastech na v&aacute;s ček&aacute; 535 km sjezdovek a 180 nejmoderněj&scaron;&iacute;ch lanovek a vleků, kter&eacute; v&aacute;s rychle a pohodlně dovezou z nadmořsk&eacute; v&yacute;&scaron;ky 580 metrů nahoru do v&yacute;&scaron;e 3 250 metrů nad mořem. Sjezd do &uacute;dol&iacute; si můžete opravdu už&iacute;t na dokonale upraven&yacute;ch svaz&iacute;ch s jistotou sněhu! - Ve vět&scaron;ině oblast&iacute; dokonce až &uacute;plně do &uacute;dol&iacute;.<br />\r\nČetn&eacute; sjezdovky v&scaron;ech stupňů obt&iacute;žnosti - od n&aacute;ročn&yacute;ch, sportovn&iacute;ch sjezdovek a sjezdovek v hlubok&eacute;m sněhu bez vyjet&eacute; stopy až po slunn&eacute;, &scaron;irok&eacute; carvingov&eacute; sjezdovky pro rodiny, zač&aacute;tečn&iacute;ky a požitk&aacute;ře - nab&iacute;zej&iacute; spr&aacute;vnou v&yacute;zvu pro každ&yacute; vkus.<br />\r\nSnowparky v Zillertalu nezanech&aacute;vaj&iacute; za sebou nesplněn&aacute; př&aacute;n&iacute;. Ať už jste zač&aacute;tečn&iacute;k, pokročil&yacute; nebo profesion&aacute;l - pro každou &uacute;roveň obt&iacute;žnosti jsou k dispozici spr&aacute;vn&eacute; kickery. Kdo k dokonal&eacute;mu odpočinku potřebuje v&iacute;ce vzru&scaron;en&iacute;, ten ať sv&eacute; dovednosti vyzkou&scaron;&iacute; na jeden&aacute;cti funlines.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
