(3287, 1493, 14358, 'hotely', 63, 'id_2_text', '<p>Př&aacute;tel&eacute; nedotčen&eacute;ho pra&scaron;anu se v Zillertalu c&iacute;t&iacute; jako v r&aacute;ji. Rozs&aacute;hl&yacute; komplex pro freeridery a skialpinisty&nbsp;s nejlep&scaron;&iacute;mi sjezdovkami s pra&scaron;anem a panensk&yacute;m svahy s hlubok&yacute;m sněhem slibuje nejen pocit svobody, ale tak&eacute; spoustu rozmanitosti. Zillertal je se sv&yacute;mi v&iacute;ce než 65 freeridersk&yacute;mi tratěmi jedn&iacute;m z největ&scaron;&iacute;ch Eldorados v Alp&aacute;ch s hlubok&yacute;m sněhem. Vzru&scaron;uj&iacute;c&iacute; varianty, sjezdovky, ale tak&eacute; fantastick&eacute; svahy s hlubok&yacute;m sněhem ve v&yacute;&scaron;ce 1 000 až 2 000 metrů nad mořem nejsou velk&yacute;m pojmem jen pro zasvěcence.</p>\r\n', 'content', 3, '(<b>Hotel č. 2</b>) Text k hotelu 1', 1100, 1),
