(3295, 1501, 14358, 'hotely', 63, 'id_3_text', '<p>Milovn&iacute;ci běžeck&eacute;ho lyžov&aacute;n&iacute; mohou poznat Zillertal během t&uacute;ry na běžkařsk&eacute; trase a prozkoumat na v&iacute;ce než 125 km stezek na různ&yacute;ch &uacute;rovn&iacute;ch obt&iacute;žnosti pro bruslen&iacute; a klasiku.<br />\r\nJ&iacute;zda po čerstvě upraven&yacute;ch běžkařsk&yacute;ch trat&iacute;ch, obklopen&yacute;ch kr&aacute;sn&yacute;mi horami Zillertalu a Pinzgau, &quot;rozbu&scaron;&iacute; srdce každ&eacute;ho zimn&iacute;ho sportovce&quot;. Trasy v Gerlosu v&aacute;s zavedou do zasněžen&yacute;ch, nedotčen&yacute;ch postrann&iacute;ch &uacute;dol&iacute; - jedinečn&yacute; př&iacute;rodn&iacute; z&aacute;žitek při zimn&iacute; dovolen&eacute; v Zillertalu. Vrcholem je přitom Sch&ouml;nachtal. &quot;Běhejte dlouho&quot; od prosince do Velikonoc na čerstvě upravovan&yacute;ch běžeck&yacute;ch trat&iacute;ch s jistotou sněhu!</p>\r\n', 'content', 3, '(<b>Hotel č. 3</b>) Text k hotelu 1', 1900, 1),
