(3303, 1509, 14358, 'hotely', 63, 'id_4_text', '<p>Třpyt&iacute;c&iacute; se ledov&eacute; krystaly, zasněžen&eacute; větve jedliček a z&aacute;řiv&yacute; slunečn&iacute; svit v kouzeln&eacute; zimn&iacute; krajině. Pě&scaron;&iacute; turistika se stala skutečn&yacute;m doplňkem i v chladn&eacute;m ročn&iacute;m obdob&iacute;. Zillertal tak&eacute; nab&iacute;z&iacute; i v zimě pestrou &scaron;k&aacute;lu možnost&iacute; d&iacute;ky v&iacute;ce než 460 km upraven&yacute;ch turistick&yacute;ch tras. Rozsah je velik&yacute;, v nab&iacute;dce najdete v&scaron;e od sportovn&iacute;ch ambici&oacute;zn&iacute;ch t&uacute;r až po kr&aacute;tk&eacute; proch&aacute;zky. Mnoh&eacute; z těchto v&yacute;&scaron;lapů jsou vhodn&eacute; i pro rodiny s mal&yacute;mi dětmi.<br />\r\nTich&aacute; postrann&iacute; &uacute;dol&iacute; s neprozkouman&yacute;mi horami a vrcholy, to se mus&iacute; zaž&iacute;t na vlastn&iacute; kůži. Četn&eacute; lyžařsk&eacute; a alpsk&eacute; &scaron;koly v &uacute;dol&iacute; nab&iacute;zej&iacute; prohl&iacute;dky s průvodcem včetně možnost&iacute; pron&aacute;jmu sportovn&iacute;ho vybaven&iacute;.</p>\r\n', 'content', 3, '(<b>Hotel č. 4</b>) Text k hotelu 1', 2700, 1),
