(3311, 1517, 14358, 'hotely', 63, 'id_5_text', '<p>Z&aacute;bava na s&aacute;ňk&aacute;ch pro mal&eacute; i velk&eacute; &ndash; 14 s&aacute;ňkařsk&yacute;ch drah o celkov&eacute; d&eacute;lce 45 kilometrů zaručuje radost pro celou rodinu &ndash; hur&aacute; na s&aacute;ně! S&aacute;ňkařsk&aacute; j&iacute;zda v zimn&iacute;m r&aacute;ji Zillertal je ide&aacute;ln&iacute; rodinn&yacute; v&yacute;let a z&aacute;žitek, kter&yacute; nadchne mlad&eacute; i star&eacute; - kr&aacute;tce řečeno, je to nutnost&iacute; během každ&eacute; zimn&iacute; dovolen&eacute;! Je dobr&eacute;, že je v Zillertalu k dispozici 14 nejl&eacute;pe upraven&yacute;ch s&aacute;ňkařsk&yacute;ch drah o celkov&eacute; d&eacute;lce přibližně 45 kilometrů. 28 km z toho je tak&eacute; osvětleno večer, takže nic nebr&aacute;n&iacute; vzru&scaron;uj&iacute;c&iacute;mu nočn&iacute;mu s&aacute;ňkov&aacute;n&iacute;!<br />\r\nNov&aacute; z&aacute;bava na sněhu se naz&yacute;v&aacute; &bdquo;Snowtubing&ldquo;. A nejlep&scaron;&iacute; ze v&scaron;eho: Tratě pro Snowtubing mohou b&yacute;t použity zdarma a tak často, jak chcete. Takto bude zimn&iacute; dovolen&aacute; v Zillertalu je&scaron;tě v&iacute;ce vzru&scaron;uj&iacute;c&iacute;!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n', 'content', 3, '(<b>Hotel č. 5</b>) Text k hotelu 1', 3500, 1),
