(3362, 15, 14156, 'intro', 64, 'intro_name', 'Vyhrajte s CORIAL víkend v Salzburgu!', 'text', 2, 'Názov', 0, 1),
(3363, 16, 14156, 'intro', 64, 'intro_perex', '<p><span style=\"font-size:20px\"><span style=\"color:#FFFFFF\"><strong>Nakupte v hodin&aacute;řstv&iacute; a klenotnictv&iacute; CORIAL a&nbsp;vyhrajte v&iacute;kend v Salzburgu!</strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(3364, 17, 14156, 'intro', 64, 'intro_content', '<p><span style=\"color:#800000\"><span style=\"font-size:18px\"><strong>Pl&aacute;nujete jako d&aacute;rek koupit &scaron;perk nebo hodinky? V hodin&aacute;řstv&iacute; a klenotnictv&iacute; Corial&nbsp;nyn&iacute; k n&aacute;kupu&nbsp;můžete vyhr&aacute;t i v&iacute;kend v Salzburgu!</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\">Jak na to?&nbsp;<strong>Stač&iacute; když, v obdob&iacute; 5.11. - 15.12. 2019, nakoup&iacute;te <a href=\"https://www.corial.cz/prodejny\" target=\"_blank\">v prodejn&aacute;ch Corial</a>&nbsp;v&nbsp;ČR nebo na <a href=\"https://www.corial.cz/\" target=\"_blank\">e-shopu Corial</a> nad 500 Kč a zaregistrujete doklad o n&aacute;kupu. </strong>Zaregistrovat se můžete i opakovaně, vždy v&scaron;ak s nov&yacute;m soutěžn&iacute;m n&aacute;kupem.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Co je ve hře?&nbsp;<strong>2x pobyt pro 2 osoby na 4 dny / 3 noci ve 3-4* hotelu, včetně sn&iacute;daně a 3-denn&iacute; karty v&yacute;hod <a href=\"https://www.salzburg.info/cs/hotely-nabidky/salzburg-card\" target=\"_blank\">SalzburgCard</a>. </strong>V&yacute;hru je možn&eacute; čerpat 1 rok od data vysatevn&iacute; poukazu (kromě rakousk&yacute;ch sv&aacute;tků a v&aacute;nočn&iacute;ch, novoročn&iacute;ch a letn&iacute;ch pr&aacute;zdnin). Term&iacute;n čerp&aacute;n&iacute; bude upřesněn mezi v&yacute;hercem a poskytovatelem pobytu, v z&aacute;vislosti na dostupnosti, dle&nbsp;voln&yacute;ch kapacit partnersk&yacute;ch hotelů.&nbsp;Pobyt je kromě dopravy.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Soutěž prob&iacute;h&aacute; 5.11. - 15.12. 2019 na &uacute;zem&iacute; ČR a SR.<strong> Přejeme V&aacute;m hodně &scaron;těst&iacute; v soutěži!</strong></span></p>\r\n', 'content', 2, 'Content', 0, 1),
