(3397, 57, 14159, 'registracia', 64, 'koniec_registracie', '<p>SOUTĚŽ BYLA UKONČENA DNE 15.12.2019.</p>\r\n\r\n<p>Slosov&aacute;n&iacute; proběhlo dne 18.12.2019, ze v&scaron;ech přijat&yacute;ch platn&yacute;ch registrac&iacute; byli dle pravidel soutěže vybr&aacute;ni&nbsp; 2&nbsp;v&yacute;herci. Dovolenkov&yacute; pobyt pro 2 osoby na 4 dny / 3 noci v rakousk&eacute;m Salzburgu, ubytov&aacute;n&iacute; ve 3-4*hotelu se sn&iacute;dan&iacute;, včetně 3 denn&iacute; karty v&yacute;hod SalzburgCard, z&iacute;sk&aacute;vaj&iacute; :</p>\r\n\r\n<p><strong>Michal Nesvadba,&nbsp;ČR<br />\r\nMarta Nov&aacute;kov&aacute;​, ČR</strong></p>\r\n\r\n<p>V&yacute;herci budou kontaktov&aacute;ni provozovatelem soutěže ohledně převzet&iacute; pobytov&yacute;ch voucherů v nejbliž&scaron;&iacute;ch dnech. Pobytov&eacute; vouchery jsou platn&eacute; do 15.12.2020, pobyty nezahrnujou dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;em děkujeme za &uacute;čast a v&yacute;hercům srdečne blahopřejeme!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnost a platnost slosov&aacute;n&iacute; potvrzuj&iacute; provozovatel&eacute; soutěže:<br />\r\nTSG Tourismus Salzburg GmbH, Auerspergstra&szlig;e 6, 5020 Salzburg,&nbsp;Rakousko&nbsp;<br />\r\na&nbsp;GOLDTIME a.s., U Libeňsk&eacute;ho pivovaru 10, Praha 8, Česk&aacute; republika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(3398, 58, 14157, 'region', 64, 'name', 'Salzburg - jeviště světa', 'text', 2, 'Názov v rámci stránky', 0, 1),
(3399, 59, 14157, 'region', 64, 'text_1', '<p><strong>Jako rodi&scaron;tě a působi&scaron;tě Wolfganga Amadea Mozarta a jako ději&scaron;tě Salcbursk&eacute;ho festivalu je Salcburk světově proslul&yacute;. Pod&iacute;v&aacute;te-li se bl&iacute;že, objev&iacute;te dokonalou harmonii př&iacute;rody a architektury zasazen&eacute; v n&aacute;dhern&eacute;m panoramatu okoln&iacute;ch hor a jezer.</strong><br />\r\nProch&aacute;zka barokn&iacute;m městem na břehu řeky Salzach, kter&eacute; je na seznamu světov&eacute;ho dědictv&iacute; UNESCO, na n&aacute;v&scaron;těvn&iacute;ka d&yacute;chne histori&iacute; a z&aacute;roveň připrav&iacute; překvapivě modern&iacute; pohledy.<br />\r\nZ&aacute;mek Mirabell a okoln&iacute; zahrada nab&iacute;zej&iacute; ohromuj&iacute;c&iacute; pohlednicov&yacute; v&yacute;hled na symbol Salcburku, mohutnou pevnost Hohensalzburg z 11. stolet&iacute;, trůn&iacute;c&iacute; majest&aacute;tně nad Muzeem moderny na M&ouml;nchsbergu. Srdcem Star&eacute;ho města je středověk&aacute; Getreidegasse, kde se narodil nejslavněj&scaron;&iacute; syn Salcburku, W.A. Mozart, dnes patř&iacute; k nejkr&aacute;sněj&scaron;&iacute;m a nejnav&scaron;těvovaněj&scaron;&iacute;m n&aacute;kupn&iacute;m ulic&iacute;m světa.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(3400, 60, 14157, 'region', 64, 'text_2', '<p>Lid&eacute; se zde r&aacute;di setk&aacute;vaj&iacute; v tradičn&iacute;ch kav&aacute;rn&aacute;ch, u &bdquo;Melange&ldquo; (k&aacute;va s na&scaron;lehan&yacute;m ml&eacute;kem) nebo &bdquo;Gro&szlig;er Brauner&ldquo; (dvojit&eacute; espresso) v kav&aacute;rně Tomaselli, nejstar&scaron;&iacute; kav&aacute;rně Rakouska, nebo hned naproti v kav&aacute;rně F&uuml;rst, kde můžete ochutnat origin&aacute;ln&iacute; Mozartovy koule, kter&eacute; zde dodnes ručně vyr&aacute;b&iacute; pravnuk jejich vyn&aacute;lezce. Ty jsou ostatně ide&aacute;ln&iacute;m d&aacute;rkem z cest, protože ty prav&eacute;, origin&aacute;ln&iacute; dostanete jen v Salcburku. Večer si pak můžete vychutnat v nejstar&scaron;&iacute;m restaurantu ve středn&iacute; Evropě, v Kl&aacute;&scaron;tern&iacute;m sklepě Sv. Petra, a nejl&eacute;pe při Mozartovsk&eacute; večeři s nejkr&aacute;sněj&scaron;&iacute;mi &aacute;riemi z Mozartov&yacute;ch oper a pokrmy dle origin&aacute;ln&iacute;ch receptů z Mozartovy doby. Kdo to m&aacute; raději trochu moderněj&scaron;&iacute;, určitě by neměl vynechat Red Bull Hangar 7. Hang&aacute;r č. 7, původně pl&aacute;novan&yacute; pro um&iacute;stěn&iacute; sb&iacute;rky historick&yacute;ch letadel a z&aacute;vodn&iacute;ch automobilů Formule 1, se stal synonymem avantgardn&iacute; architektury, modern&iacute;ho uměn&iacute; a &scaron;pičkov&eacute; gastronomie.</p>\r\n', 'content', 2, 'Text 2', 0, 1),
