(3405, 199, 14162, 'partneri', 64, 'id_1_text', '<p><strong>Klenotnick&eacute; obchody CORIAL provozuje společnost Goldtime a.s. už v&iacute;c než 20 let.</strong><br />\r\nKromě prodejen a e-shopu Corial na z&aacute;kladě fran&scaron;&iacute;zov&eacute; smlouvy provozuje v Česku tak&eacute; 5 značkov&yacute;ch prodejen Pandora. Od roku 2017 provozujeme internetov&yacute; obchod www.corial.cz. Jsme držitelem certifik&aacute;tu &quot;Ověřeno z&aacute;kazn&iacute;ky Heureka&quot;, kter&yacute; rozli&scaron;uje obchody poskytuj&iacute;c&iacute; kvalitn&iacute; služby sv&yacute;m z&aacute;kazn&iacute;kům.<br />\r\nNyn&iacute; můžete nakupovat ve 14 prodejn&aacute;ch v n&aacute;kupn&iacute;ch centrech v Česku a na Slovensku a tak&eacute; v česk&eacute;m e-shopu.&nbsp;</p>\r\n\r\n<p>V prodejn&aacute;ch Corial najdete hodinky a &scaron;perky renomovan&yacute;ch značek, jako třeba Citizen, Bulova, Bering, Swiss Military Hanova, Police. Mezi obl&iacute;ben&eacute; značky patř&iacute; i Maurice Lacroix, Tissot, Edox, Fr&eacute;derique Constant, Invicta, Festina, Casio a mnoho dal&scaron;&iacute;ch. Exkluzivně prod&aacute;v&aacute;me i vlastn&iacute; hodin&aacute;řsk&eacute; značky Telstar a Sundial a vlastn&iacute; značku stř&iacute;brn&yacute;ch &scaron;perků Silverino.<br />\r\nV každ&eacute; na&scaron;&iacute; prodejně v&aacute;m ochotně porad&iacute;me a pomůžeme s v&yacute;běrem. Přejeme V&aacute;m př&iacute;jemn&eacute; nakupov&aacute;n&iacute;!</p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
