(3415, 1485, 14358, 'hotely', 64, 'id_1_text', '<p>C&iacute;tit se blaze v butikov&eacute;m hotelu, kde si ruce pod&aacute;vaj&iacute; tradice a modern&iacute; styl. Př&iacute;mo v centru Schladmingu, jen p&aacute;r metrů od lyžařsk&yacute;ch sjezdovek. Uvolněte se v l&aacute;zn&iacute;ch nad střechami horsk&eacute;ho města. Regenerujte během mas&aacute;ž&iacute;, hodin j&oacute;gy a meditačn&iacute;m sezen&iacute;m. Zhluboka se nadechněte v čajovně s v&yacute;hledem na hory. Nechte se h&yacute;čkat v restauraci s rakouskou, ayurv&eacute;dskou a z&aacute;saditou lehce stravitelnou kuchyn&iacute;.</p>\r\n', 'content', 3, '(<b>Hotel č. 1</b>) Text k hotelu 1', 300, 1),
