(3499, 16, 14156, 'intro', 65, 'intro_perex', '<p><span style=\"color:#FFFFFF\"><span style=\"font-size:20px\"><strong>Nak&uacute;pte v hodin&aacute;rstve a&nbsp;klenotn&iacute;ctve CORIAL a vyhrajte v&iacute;kend v Salzburgu!</strong></span></span></p>\r\n', 'content', 2, 'Perex', 0, 1),
(3500, 17, 14156, 'intro', 65, 'intro_content', '<p><span style=\"color:#800000\"><span style=\"font-size:18px\"><strong>Pl&aacute;nujete&nbsp;ako darček k&uacute;piť &scaron;perk alebo hodinky? V hodin&aacute;rstve a klenotn&iacute;ctve Corial m&ocirc;žete teraz k&nbsp;n&aacute;kupu vyhrať aj v&iacute;kend v Salzburgu!</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\">Ako na to? <strong>Stač&iacute; ak v obdob&iacute; 5.11. - 15.12. 2019 nak&uacute;pite <a href=\"http://www.corial.sk/cs/predajne/\" target=\"_blank\">v predajniach Corial</a> v SR alebo na <a href=\"http://www.corial.cz/\" target=\"_blank\">e-shope Corial</a> nad 25 &euro; a zaregistrujete doklad z n&aacute;kupu.</strong> Zaregistrovať sa m&ocirc;žete aj opakovane, vždy v&scaron;ak s nov&yacute;m s&uacute;ťažn&yacute;m n&aacute;kupom.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Čo je v hre? <strong>2x pobyt pre 2 osoby na 4 dni / 3 noci v 3-4* hoteli s raňajkami a 3-dennou kartou v&yacute;hod <a href=\"https://www.salzburg.info/cs/hotely-nabidky/salzburg-card\" target=\"_blank\">SalzburgCard</a>.</strong> V&yacute;hru je možn&eacute; čerpať 1 rok od d&aacute;tumu vysatevnia poukazu (okrem rak&uacute;skych sviatkov a vianočn&yacute;ch, novoročn&yacute;ch a letn&yacute;ch pr&aacute;zdnin). Term&iacute;n čerpania bude upresnen&yacute; medzi v&yacute;hercom a poskytovateľom pobytu v&nbsp;z&aacute;vislosti od voľn&yacute;ch kapac&iacute;t partnersk&yacute;ch hotelov. Pobyt nezahŕňa dopravu.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">S&uacute;ťaž prebieha 5.11. - 15.12. 2019 na &uacute;zem&iacute; SR a ČR. <strong>Prajeme V&aacute;m veľa &scaron;ťastia v s&uacute;ťaži!</strong></span></p>\r\n', 'content', 2, 'Content', 0, 1),
