(3533, 57, 14159, 'registracia', 65, 'koniec_registracie', '<p>S&Uacute;ŤAŽ BOLA UKONČEN&Aacute;&nbsp;DŇA 15.12.2019.</p>\r\n\r\n<p>Žrebovanie prebehlo&nbsp;dňa 18.12.2019, zo&nbsp;v&scaron;etk&yacute;ch&nbsp;prijat&yacute;ch platn&yacute;ch registr&aacute;ci&iacute;&nbsp;boli podľa&nbsp;pravidiel s&uacute;ťaže&nbsp;vybran&iacute;&nbsp; 2&nbsp;v&yacute;herci. Dovolenkov&yacute; pobyt pre&nbsp;2 osoby na 4 dni&nbsp;/ 3 noci v rak&uacute;skom Salzburgu, ubytovanie v 3-4*hoteli s raňajkami, vr&aacute;tane 3 dennej karty v&yacute;hod SalzburgCard,&nbsp;z&iacute;skavaj&uacute;&nbsp;:</p>\r\n\r\n<p><strong>Michal Nesvadba,&nbsp;ČR<br />\r\nMarta Nov&aacute;kov&aacute;​, ČR</strong></p>\r\n\r\n<p>V&yacute;herci bud&uacute;&nbsp;kontaktovan&iacute;&nbsp;organiz&aacute;torom&nbsp;s&uacute;ťaže&nbsp;ohľadom&nbsp;prevzatia&nbsp;pobytov&yacute;ch&nbsp;voucherov v najbliž&scaron;&iacute;ch&nbsp;dňoch. Pobytov&eacute; vouchery s&uacute;&nbsp;platn&eacute; do 15.12.2020, pobyty nezahŕńaj&uacute;&nbsp;dopravu.</p>\r\n\r\n<p><u><strong>V&scaron;etk&yacute;m&nbsp;ďakujeme&nbsp;za &uacute;časť&nbsp;a v&yacute;hercom&nbsp;srdečne blahožel&aacute;me!</strong></u></p>\r\n\r\n<p><span style=\"font-size:12px\">Spr&aacute;vnosť&nbsp;a platnosť žrebovania&nbsp;potvrdzuj&uacute;&nbsp;organiz&aacute;tori&nbsp;s&uacute;ťaže:<br />\r\nTSG Tourismus Salzburg GmbH, Auerspergstra&szlig;e 6, 5020 Salzburg,&nbsp;Rakousko&nbsp;</span><br />\r\n<span style=\"font-size:12px\">a&nbsp;GOLDTIME BL spol. s.r.o., Rezedova 5, 821 01 Bratislava. Slovensk&aacute; republika</span></p>\r\n', 'content', 3, 'Text po ukončení registrácie', 0, 1),
(3534, 58, 14157, 'region', 65, 'name', 'Salzburg - javisko sveta', 'text', 2, 'Názov v rámci stránky', 0, 1),
(3535, 59, 14157, 'region', 65, 'text_1', '<p><span style=\"font-size:16px\"><strong>Salzburg - javisko sveta</strong></span><br />\r\n<strong>Ako rodisko a p&ocirc;sobisko Wolfganga Amadea Mozarta a ako dejisko Salzburgsk&eacute;ho festivalu je Salzburg svetozn&aacute;my. Ak sa lep&scaron;ie prizriete, objav&iacute;te dokonal&uacute; harm&oacute;niu pr&iacute;rody a architekt&uacute;ry zasadenej v prekr&aacute;snom panor&aacute;mate okolit&yacute;ch h&ocirc;r a jazier.</strong><br />\r\nPrech&aacute;dzka barokov&yacute;m mestom na brehu rieky Salzach, ktor&eacute; ja na zozname svetov&eacute;ho dedičstva UNESCO, d&yacute;chne na n&aacute;v&scaron;evn&iacute;ka hist&oacute;riou a z&aacute;roveň priprav&iacute; prekvapivo modern&eacute; pohľady. Mirabellsk&yacute; z&aacute;mok a okolit&eacute; z&aacute;hrady pon&uacute;kaj&uacute; n&aacute;dhern&yacute; pohľad na symbol mesta Salzburg, majest&aacute;tnu pevnosť Hohensalzburg z 11. Storočia t&yacute;čiacu sa nad M&uacute;zeom moderny na M&ouml;nchsbergu. Srdcom star&eacute;ho mesta je stredovek&aacute; Getreidegasse, kde sa narodil najzn&aacute;mej&scaron;&iacute; salzburgsk&yacute; syn W.A. Mozart, t&aacute;to ulica dnes par&iacute; k najkraj&scaron;&iacute;m a najnav&scaron;tevovanej&scaron;&iacute;m n&aacute;kupn&yacute;m uliciam sveta.</p>\r\n', 'content', 2, 'Text 1', 0, 1),
(3536, 60, 14157, 'region', 65, 'text_2', '<p>Ľudia sa tu radi stret&aacute;vaj&uacute; v kaviarňach s bohatou trad&iacute;ciou, pri &bdquo;Melange&ldquo; (k&aacute;va s na&scaron;ľahan&yacute;m mliekom) alebo &bdquo;Gro&szlig;er Brauner&ldquo; (dvojit&eacute; espresso) v kaviarni Tomaselli, najstar&scaron;ej kaviarni v Rak&uacute;sku, alebo hneď oproti v kaviarni F&uuml;rst, kde m&ocirc;žete e&scaron;te st&aacute;le ochutnať ručne vyroben&eacute; origin&aacute;lne salzburgsk&eacute; Mozartove gule od pravnuka ich vyn&aacute;lezcu. Tie s&uacute; mimochodom ide&aacute;lnym suven&iacute;rom zo Salzburgu, pretože tie prav&eacute; sa daj&uacute; k&uacute;piť len tu. Večer m&ocirc;žete nechať doznieť v kl&aacute;&scaron;tornej re&scaron;taur&aacute;cii Stiftskeller St. Peter, najstar&scaron;ej re&scaron;taur&aacute;cii v strednej Eur&oacute;pe, pri Mozartovskej večeri s najkraj&scaron;&iacute;mi &aacute;riami z Mozartov&yacute;ch opier a jedlami podľa origin&aacute;lnych receptov z doby Mozarta. Kto to m&aacute; rad&scaron;ej trocha modernej&scaron;ie, určite by nemal vynechať Red Bull Hangar 7. Hang&aacute;r č. 7, p&ocirc;vodne pl&aacute;novan&yacute; pre umiestnenie zbierky historick&yacute;ch lietadiel a pretek&aacute;rskych automobilov Formule 1, sa stal synonymom avantgardnej architekt&uacute;ry, modern&eacute;ho umenia a &scaron;pičkovej gastron&oacute;mie.</p>\r\n', 'content', 2, 'Text 2', 0, 1),
