(3541, 199, 14162, 'partneri', 65, 'id_1_text', '<p><strong>Hodin&aacute;rske a klenotn&iacute;cke obchody CORIAL funguj&uacute; na Českom a Slovenskom trhu už viac ako 20 rokov.</strong> Od roku 2017 prev&aacute;dzkujeme internetov&yacute; obchod www.corial.cz. Sme držitelem certifik&aacute;tu &quot;Overen&eacute; z&aacute;kazn&iacute;kmi Heureka&quot;, ktor&yacute; rozli&scaron;uje obchody poskytuj&uacute;ce kvalitn&eacute; služby svojim z&aacute;kazn&iacute;kom.<br />\r\nV s&uacute;časnosti je z&aacute;kazn&iacute;kom k dispoz&iacute;cii 14 predajn&iacute; v n&aacute;kupn&yacute;ch centr&aacute;ch v Česku a na Slovensku a taktiež v českom e-shope.</p>\r\n\r\n<p>V predajniach CORIAL si m&ocirc;žete vybrať zo &scaron;irokej ponuky klasick&yacute;ch, m&oacute;dnych a elegantn&yacute;ch hodiniek a &scaron;perkov svetov&yacute;ch značiek, ako s&uacute; Citizen, Bulova, Bering, Swiss Military Hanova, Police. Medzi obľ&uacute;ben&eacute; značky paria aj Maurice Lacroix, Tissot, Edox, Fr&eacute;derique Constant, Invicta, Festina, Casio a mnoho ďaľ&scaron;&iacute;ch. Exkluz&iacute;vne pred&aacute;v&aacute;me aj vlastn&eacute; hodin&aacute;rske značky Telstar a Sundial, vlastn&uacute; značku strieborn&yacute;ch &scaron;perkov Silverino a&nbsp;v Česku&nbsp;prev&aacute;dzkujeme 5 značkov&yacute;ch predajn&iacute;&nbsp;Pandora.<br />\r\nV každej z na&scaron;ich predajn&iacute; v&aacute;m ochotne porad&iacute;me a pom&ocirc;žeme s v&yacute;berom. <strong>Prajeme V&aacute;m pr&iacute;jemn&eacute; nakupovanie!</strong></p>\r\n', 'content', 3, 'Hlavný text k partnerovi', 0, 1),
