(114719, 114097, 58, 'sk', 'suhlas_s_podmienkami_1', 'static', '', 'SÚHLASíM S PRAVIDLAMI SÚŤAŽE a udeľujem týmto svoj SÚHLAS so spracovaním vyššie uvedených osobných údajov v súlade so zákonom o ochrane osobných údajov v zmysle Nariadenia (EU) 2016/679 (GDPR). Bližšie informácie ohľadom spracovania osobných údajov sú upresnené v PRAVIDLÁCH SÚŤAŽE TU.', 1, 0),
(114720, 114098, 58, 'sk', 'registracia', 'static', '', 'Registrácia', 1, 0),
(114721, 114130, 58, 'sk', 'nova_registracia', 'static', '', 'Ďakujeme za Vašu registráciu do súťaže. Pokiaľ máte ďaľší doklad o nákupe môžete prejsť k novej registrácii. Potvrdenie o registrácii sa automaticky posiela na vami zadaný e-mail, prosím skontrolujte si tiež SPAM zložku, ďakujeme za pochopenie.', 1, 0),
(114742, 114465, 58, 'sk', 'dakujeme_za_registraciu', 'static', '', 'Ďakujeme za Vašu registráciu v súťaži Predeti.SK a Sonnentherme. Prajeme Vám veľa šťastia v súťaži!', 1, 0),
(114743, 114584, 58, 'sk', 'suhlas_s_newslettrom_1', 'static', '', 'ÁNO, mám záujem získavať zaujímavé ponuky a novinky od Sonnentherme Lutzmannsburg - Hotel Sonnenpark a SÚHLASÍM zo spracovaním mojich osobných údajov pre MARKETINGOVÉ ÚČELY podľa pravidiel súťaže.', 1, 0),
(114754, 114754, 57, 'sk', 'suhlas_s_newslettrom_1', 'static', '', 'ANO, mám zájem získávat zajímavé nabídky a novinky od Sonnentherme Lutzmannsburg - Hotel Sonnenpark a SOUHLASÍM se zpracováním mých osobních údajů pro MARKETINGOVÉ ÚČELY dle pravidel soutěže.', 1, 0),
(114755, 114755, 57, 'sk', 'dakujeme_za_registraciu', 'static', '', 'Děkujeme za Vaši registraci v soutěži FEEDO a Sonnentherme. Přejeme Vám hodně štěstí v soutěži!', 1, 0),
(114756, 114756, 57, 'sk', 'nova_registracia', 'static', '', 'Děkujeme za Vaši registraci v soutěži. Pokud máte další doklad o nákupu můžete přejít k nové registraci. Potvrzení o registraci se automaticky zasílá na vámi zadaný e-mail, prosím zkontrolujte si také SPAM složku, děkujeme za pochopení.', 1, 0),
(114757, 114757, 57, 'sk', 'registracia', 'static', '', 'Registrace', 1, 0),
