(114944, 114944, 60, 'sk', 'suhlas_s_newslettrom_1', 'static', '', 'TAK, jestem zainteresowany(a) otrzymywaniem interesujących ofert i nowości od Sonnentherme Lutzmannsburg – Hotel Sonnenpark i WYRAŻAM ZGODĘ na przetwarzanie moich danych osobowych w CELACH MARKETINGOWYCH zgodnie z regulaminem loterii.', 1, 0),
(114945, 114945, 60, 'sk', 'dakujeme_za_registraciu', 'static', '', 'Dziękujemy za udział w loterii FEEDO i Sonnentherme i życzymy dużo szczęścia podczas losowania!', 1, 0),
(114946, 114946, 60, 'sk', 'nova_registracia', 'static', '', 'Dziękujemy za rejestrację do loterii. Jeśli posiadasz kolejny paragon (fakturę) potwierdzający zakup możesz przejść do nowej rejestracji. Potwierdzenie rejestracji zostaje automatycznie wysłane na podany przez Ciebie e-mail, sprawdź również SPAM, dziękujemy za zrozumienie.', 1, 0),
(114947, 114947, 60, 'sk', 'registracia', 'static', '', 'Rejestracja', 1, 0),
(114948, 114948, 60, 'sk', 'suhlas_s_podmienkami_1', 'static', '', 'WYRAŻAM ZGODĘ NA WARUNKI LOTERII i udzielam niniejszym swojej zgody na przetwarzanie wyżej wymienionych danych osobowych zgodnie z przepisami o ochronie danych osobowych w rozumieniu rozporządzenia 2016/679 (RODO) Parlamentu Europejskiego i Rady UE. Więcej informacji na temat przetwarzania danych osobowych w REGULAMINIE LOTERII TUTAJ.', 1, 0),
