(115063, 114097, 62, 'sk', 'suhlas_s_podmienkami_1', 'static', '', 'SÚHLASíM S PRAVIDLAMI SÚŤAŽE a udeľujem týmto svoj SÚHLAS so spracovaním vyššie uvedených osobných údajov v súlade so zákonom o ochrane osobných údajov v zmysle Nariadenia (EU) 2016/679 (GDPR). Bližšie informácie ohľadom spracovania osobných údajov sú upresnené v PRAVIDLÁCH SÚŤAŽE TU.', 1, 0),
(115064, 114098, 62, 'sk', 'registracia', 'static', '', 'Registrácia', 1, 0),
