(115066, 114132, 62, 'sk', 'text_newsletter_embed_1', 'static', '', 'ÁNO, mám záujem získavať zaujímavé ponuky a novinky od Explorer Hotels a SÚHLASÍM zo spracovaním mojich osobných údajov pre MARKETINGOVÉ ÚČELY podľa pravidiel súťaže.', 1, 0),
